"489930":{"id":"489930","name":"Ponto Cego","slug":"ponto-cego","original_title":"Blindspotting","overview":"O filme segue Collin (Daveed Diggs), que deve passar pelos últimos três dias de liberdade condicional para ganhar a chance de um novo começo. Ele e seu amigo de infância problemático, Miles (Rafael Casal), trabalham como mensageiros e, quando Collin testemunha um tiroteio policial, a amizade dos dois homens é testada à medida que lidam com suas identidades e diferentes realidades no bairro em que cresceram.","first_air_date":"2018-07-20","runtime":95,"episode_run_time":[95],"vote_average":7.4,"created_by":["Summit Entertainment","Snoot Entertainment","Codeblack Films"],"production_companies":[{"name":"Summit Entertainment"},{"name":"Snoot Entertainment"},{"name":"Codeblack Films"}],"cast":["Daveed Diggs","Rafael Casal","Janina Gavankar","Jasmine Cephas Jones","Ethan Embry"],"backdrop_path":"https://image.tmdb.org/t/p/original/qNYL8EAUPvTaiW1hVavX1vIWVcl.jpg","poster_path":"https://image.tmdb.org/t/p/original/gjcaxEzG5G1E7aZiQsznYh1VMGK.jpg","certification":"14","genres":["Comédia","Crime","Drama"],"trailer":"N/A"},
"566872":{"id":"566872","name":"Tudo Pela Arte","slug":"tudo-pela-arte","original_title":"The Burnt Orange Heresy","overview":"Contratado para roubar uma pintura rara de um dos a maioria dos pintores enigmáticas de todos os tempos, um negociante de arte ambiciosa torna-se consumido por sua própria ganância e insegurança como a operação gira fora de controle","first_air_date":"2020-03-06","runtime":99,"episode_run_time":[99],"vote_average":5.6,"created_by":["MJZ","Rumble Films","Wonderful Films","Indiana Production"],"production_companies":[{"name":"MJZ"},{"name":"Rumble Films"},{"name":"Wonderful Films"},{"name":"Indiana Production"}],"cast":["Claes Bang","Elizabeth Debicki","Mick Jagger","Donald Sutherland","Rosalind Halstead"],"backdrop_path":"https://image.tmdb.org/t/p/original/aT2oYSXA5UiTS5pmqfcsoG74cQx.jpg","poster_path":"https://image.tmdb.org/t/p/original/blApdSV7109sOhLijJ2T09XWFwW.jpg","certification":"16","genres":["Mistério","Thriller","Crime"],"trailer":"N/A"},
"34689":{"id":"34689","name":"A Condessa Descalça","slug":"a-condessa-descalca","original_title":"The Barefoot Contessa","overview":"No funeral de Maria Vargas, várias pessoas se lembram de quem ela era e o impacto que ela causou sobre eles. Harry Dawes era um não muito bem sucedido escritor/diretor quando ele e produtor de cinema Kirk Edwards descobriram ela em uma boate de segunda, onde ela trabalhava como dançarina de flamenco. Ele a convenceu a aceitar a chance de atuação e seu primeiro filme foi um enorme sucesso. O Relações Públicas Oscar Muldoon se lembra de quando Maria estava no tribunal apoiando seu pai, que foi acusado de assassinar sua mãe. Foi o testemunho de Maria que o livrou e ela foi uma estrela maior do que nunca. Alberto Bravano, um dos homens mais ricos da América do Sul, lança seu olhar sobre Maria e ela sai com ele - mais para irritar Edwards do que outra coisa - mas ele a trata mal. Quando ela conhece o Conde Vincenzo Torlato-Favrini ficam profundamente apaixonados. Eles se casam, mas eles não têm uma vida feliz.","first_air_date":"1954-09-29","runtime":128,"episode_run_time":[128],"vote_average":6.8,"created_by":["Figaro Incorporated Production","Transoceanic Film","United Artists"],"production_companies":[{"name":"Figaro Incorporated Production"},{"name":"Transoceanic Film"},{"name":"United Artists"}],"cast":["Humphrey Bogart","Ava Gardner","Edmond O'Brien","Marius Goring","Valentina Cortese"],"backdrop_path":"https://image.tmdb.org/t/p/original/2yK59yDiP4P5hsENbGYSPc3YA5I.jpg","poster_path":"https://image.tmdb.org/t/p/original/5K83SyWx7M2ubyp44AM4xGhLyki.jpg","certification":"e 16","genres":["Drama"],"trailer":"N/A"},
