"467248":{"id":"467248","name":"As Apimentadas #Desafio Mundial","slug":"as-apimentadas-desafio-mundial","original_title":"Bring It On: Worldwide #Cheersmack","overview":"Vivica A. Fox faz sua estreia em “As Apimentadas” como Cheer Goddess, a “Torcelebridade” mais popular da internet. Quando Destiny (Cristine Prosperi), capitã das “Rebels”, tricampeãs nacionais, é desafiada a participar de uma competição mundial por uma equipe nova e radical chamada “The Truth”, a Cheer Goddess organiza uma batalha virtual com equipes de diversos países. Parece que o mundo inteiro quer derrubar Destiny e sua equipe, e talvez eles consigam, a menos que Destiny enfrente o desafio, deixe seu ego de lado e descubra quem são suas amigas de verdade.","first_air_date":"2017-08-29","runtime":95,"episode_run_time":[95],"vote_average":6.0,"created_by":["Universal 1440 Entertainment"],"production_companies":[{"name":"Universal 1440 Entertainment"}],"cast":["Cristine Prosperi","Jordan Rodrigues","Gia Lodge-O'Meally","Sophie Vavasseur","Sven Ruygrok"],"backdrop_path":"https://image.tmdb.org/t/p/original/pPnpN7kFw8fN97mtW27VTq798Nh.jpg","poster_path":"https://image.tmdb.org/t/p/original/ghE18uV8scGieT028phiGF3pI6V.jpg","certification":"N/A","genres":["Comédia","Romance"],"trailer":"N/A"},
