"823395":{"id":"823395","name":"O Padeiro","slug":"o-padeiro","original_title":"The Baker","overview":"Um homem quieto e estóico, vive uma existência de monge em um exílio auto-imposto. Quando seu filho afastado é morto em um negócio de drogas que deu errado, ele fica encarregado de cuidar de uma neta que ele nunca soube que existia e é forçado a voltar a uma vida que tentou deixar para trás.","first_air_date":"2023-07-27","runtime":100,"episode_run_time":[100],"vote_average":6.3,"created_by":["Productivity Media","Darius Films"],"production_companies":[{"name":"Productivity Media"},{"name":"Darius Films"}],"cast":["Ron Perlman","Elias Koteas","Harvey Keitel","Joel David Moore","Emma Ho"],"backdrop_path":"https://image.tmdb.org/t/p/original/usKCKmo1UcVsz0t3NNbkPXCmyk1.jpg","poster_path":"https://image.tmdb.org/t/p/original/2deqSt3Z3OXgBfLvUn9jASrKa1c.jpg","certification":"N/A","genres":["Ação","Drama","Crime"],"trailer":"N/A"},
"1162":{"id":"1162","name":"O Milagre de Anne Sullivan","slug":"o-milagre-de-anne-sullivan","original_title":"The Miracle Worker","overview":"Uma história verdadeira. A jovem Helen Keller (Patty Duke), cega, surda e muda desde a infância, corre o risco de ser enviada para uma instituição. A incapacidade de comunicar deixou sua frustração e violência. Em desespero, seus pais procuram ajuda do Instituto Perkins, o que lhes envia uma \"aluna Yankee meio cega\", chamada Annie Sullivan (Anne Bancroft), para ensinar sua filha. Através da persistência e do amor, e de pura teimosia, Annie rompe as paredes de silêncio e escuridão de Helen e a ensina a se comunicar.","first_air_date":"1962-05-23","runtime":106,"episode_run_time":[106],"vote_average":7.9,"created_by":["Playfilm Productions"],"production_companies":[{"name":"Playfilm Productions"}],"cast":["Anne Bancroft","Patty Duke","Victor Jory","Inga Swenson","Andrew Prine"],"backdrop_path":"https://image.tmdb.org/t/p/original/5bvQEihHBKJ0Rs1J46HcG0wASDr.jpg","poster_path":"https://image.tmdb.org/t/p/original/m9oLw5LXs4OlH3O3iAr417UcCXW.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
