"373476":{"id":"373476","name":"Desconhecida","slug":"desconhecida","original_title":"Complete Unknown","overview":"Oferecendo um jantar em casa junto com a esposa, Tom (Michael Shannon) recebe com surpresa Alice (Rachel Weisz), acompanhante de um dos convidados. Ele tem certeza que a conhece, ainda que o nome e as informações compartilhadas não batam com suas lembranças, e a reunião de amigos transforma-se em uma jornada dupla de (re)conhecimento.","first_air_date":"2016-08-26","runtime":90,"episode_run_time":[90],"vote_average":5.1,"created_by":["Great Point Media","Parts & Labor","Heron Television"],"production_companies":[{"name":"Great Point Media"},{"name":"Parts & Labor"},{"name":"Heron Television"}],"cast":["Rachel Weisz","Michael Shannon","Kathy Bates","Danny Glover","Michael Chernus"],"backdrop_path":"https://image.tmdb.org/t/p/original/hvx3QJyDhRDyanz7yEOsMEDl25g.jpg","poster_path":"https://image.tmdb.org/t/p/original/kN69Ab3d68owotgHAimF2stUv3Y.jpg","certification":"12","genres":["Drama","Mistério","Thriller"],"trailer":"N/A"},
"77987":{"id":"77987","name":"Só Deus Perdoa","slug":"so-deus-perdoa","original_title":"Only God Forgives","overview":"Um homem (Ryan Gosling) vive um exílio em Bagkok durante dez anos, depois de ter matado um policial. Ele mantém um clube de boxe, que funciona como disfarce para o tráfico de drogas. Quando seu irmão é assassinado depois de matar uma prostituta, o protagonista recebe a visita de sua mãe, que pretende resgatar o cadáver do filho mais novo e vingar-se dos homens que o mataram.","first_air_date":"2013-05-30","runtime":90,"episode_run_time":[90],"vote_average":5.8,"created_by":["Wild Bunch","Bold Films","Gaumont","Film i Väst","Space Rocket Nation","Motel Movies"],"production_companies":[{"name":"Wild Bunch"},{"name":"Bold Films"},{"name":"Gaumont"},{"name":"Film i Väst"},{"name":"Space Rocket Nation"},{"name":"Motel Movies"}],"cast":["Ryan Gosling","Kristin Scott Thomas","วิทยา ปานศรีงาม","รฐา โพธิ์งาม","Gordon Brown"],"backdrop_path":"https://image.tmdb.org/t/p/original/pRrQMx00P8LaXGwJXYJ2tRGoVOs.jpg","poster_path":"https://image.tmdb.org/t/p/original/cZbXB8yl4kz54dbeQsEhHdyZGuK.jpg","certification":"N/A","genres":["Drama","Thriller","Crime"],"trailer":"N/A"},
