"4786":{"id":"4786","name":"Rudo e Cursi - A Vida é uma Viagem","slug":"rudo-e-cursi-a-vida-e-uma-viagem","original_title":"Rudo y Cursi","overview":"Beto (Diego Luna) e Tato (Gael García Bernal) são irmãos que largaram a vida de camponeses para tentar a sorte nos campos de futebol. Apensar do sonho fraterno de construir uma casa para a mãe, os dois vivem em disputa, dentro e fora do campo, numa relação de amor e ódio. O sucesso vem quando um olheiro descobre seus talentos. Tato, que sonha ser um cantor famoso, muda-se para a cidade e se torna a estrela do Deportivo Amaranto, e passa a ser chamado de \"Cursi\". Beto, que recebe o apelido de \"Rudo\", se sente traído, mas logo acaba como goleiro. Em breve estarão num mundo de luxo, fama e lindas mulheres. Nessa nova realidade, parecem ter deixado de lado as diferenças. Mas, quando estão a ponto de realizar seus sonhos, ressurgem as rivalidades, medos e limitações. \"Rudo Y Cursi\" é um filme emocionante dirigido por Carlos Cuarón e produzido por uma equipe agora famosa em Hollywood: Guilherme Del Toro; Alejandro González Iñárritu e Alfonso Cuarón.","first_air_date":"2008-12-19","runtime":102,"episode_run_time":[102],"vote_average":7.1,"created_by":["Focus Features","Cha Cha Chá","Universal Pictures"],"production_companies":[{"name":"Focus Features"},{"name":"Cha Cha Chá"},{"name":"Universal Pictures"}],"cast":["Gael García Bernal","Diego Luna","Guillermo Francella","Dolores Heredia","Adriana Paz"],"backdrop_path":"https://image.tmdb.org/t/p/original/bmjo4w9MoLag2BjayBIHCAl0w0e.jpg","poster_path":"https://image.tmdb.org/t/p/original/xFGuhPSe1mCRcOllLlJYoNUknNt.jpg","certification":"N/A","genres":["Comédia","Drama"],"trailer":"N/A"},
