"11787":{"id":"11787","name":"Meu Amigo Harvey","slug":"meu-amigo-harvey","original_title":"Harvey","overview":"Devido à sua insistência de que ele tem um coelho invisível de 1,80 m de altura como seu melhor amigo, um homem de meia-idade lunático é considerado por sua família como insano. Mas ele pode ser mais sábio do que se pensa.\r O clássico sucesso dos palcos recebe o tratamento de Hollywood na história de Elwood P. Dowd, que torna-se amigo de um fantasma na forma de um coelho de tamanho humano chamado Harvey que só ele vê (e alguns outros privilegiados na ocasião também.) Depois que sua irmã tenta interná-lo numa instituição mental, uma comédia de erros se segue. Elwood e Harvey se tornam os catalisadores para que uma família possa remendar suas feridas e para o romance florescer em lugares inesperados.","first_air_date":"1950-12-04","runtime":104,"episode_run_time":[104],"vote_average":7.7,"created_by":["Universal International Pictures"],"production_companies":[{"name":"Universal International Pictures"}],"cast":["James Stewart","Josephine Hull","Peggy Dow","Charles Drake","Cecil Kellaway"],"backdrop_path":"https://image.tmdb.org/t/p/original/1S746wWQqnvvNXGajQCJsivwNRi.jpg","poster_path":"https://image.tmdb.org/t/p/original/9JSnXExFSIAwr2ikpplI3HtSfS0.jpg","certification":"e Livre","genres":["Comédia","Fantasia"],"trailer":"N/A"},
