"163907":{"id":"163907","name":"Cactus Jack, o Vilão","slug":"cactus-jack-o-vilao","original_title":"The Villain","overview":"Um atraente desconhecido (Arnold Schwarzenegger) concorda em acompanhar a jovem Charming Jones (Ann-Margret) para receber a herança do seu pai. Porém, Avery Simpson (Jack Elam) quer ficar com o dinheiro e, para isso, contrata o notório fora da lei Cactus Jack (Kirk Douglas) para armar uma emboscada para a garota. Mas o que não se espera é que Cactus Jack não tem muita habilidade em roubar pessoas.","first_air_date":"1979-07-26","runtime":84,"episode_run_time":[84],"vote_average":5.7,"created_by":["Rastar Productions"],"production_companies":[{"name":"Rastar Productions"}],"cast":["Kirk Douglas","Ann-Margret","Arnold Schwarzenegger","Paul Lynde","Foster Brooks"],"backdrop_path":"https://image.tmdb.org/t/p/original/50VPuFP2zpNqxI0pJXPC8Pi1Sjv.jpg","poster_path":"https://image.tmdb.org/t/p/original/xs8JEbXMkMUtY30HwFiFsrLQDs2.jpg","certification":"12","genres":["Comédia","Faroeste"],"trailer":"N/A"},
"15155":{"id":"15155","name":"G - Triângulo Amoroso","slug":"g-triangulo-amoroso","original_title":"G","overview":"Depois de construir um negócio de mega-sucesso, o músico Summer G (Richard T. Jones) se junta novamente com Sky (Chenoa Maxwell), uma linda mulher que o deixou para ficar com Chip (Blair Underwood). Mas, enquanto as chamas da paixão são re-acesas, o calor deste mortal triângulo amoroso ameaça queimar a todos que o tocam.","first_air_date":"2002-05-10","runtime":96,"episode_run_time":[96],"vote_average":6.6,"created_by":["Andrew Lauren Productions"],"production_companies":[{"name":"Andrew Lauren Productions"}],"cast":["Richard T. Jones","Blair Underwood","Chenoa Maxwell","Andre Royo","Laz Alonso"],"backdrop_path":"https://image.tmdb.org/t/p/originalnull","poster_path":"https://image.tmdb.org/t/p/original/llkGqfyHf4ZOxpGsl6H8F649duM.jpg","certification":"N/A","genres":["Drama","Romance"],"trailer":"N/A"},
