"70584":{"id":"70584","name":"Hellraiser: Revelações","slug":"hellraiser-revelacoes","original_title":"Hellraiser: Revelations","overview":"Durante uma noite de farra no México, os amigos Steven Craven (Nick Eversman) e Nico Bradley (Jay Gillespie) abrem uma caixa suspeita, em um estranho ritual, onde surgem seres das trevas conhecidos como Cenobitas. Um ano depois, Emma (Tracey Fairaway), irmã de Steven, redescobre a caixa e decide abri-lá. Porém, a atitude gera consequências para as duas famílias.","first_air_date":"2011-10-18","runtime":75,"episode_run_time":[75],"vote_average":3.6,"created_by":["Neo Art & Logic","Puzzlebox Films","Dimension Extreme","Dimension Films"],"production_companies":[{"name":"Neo Art & Logic"},{"name":"Puzzlebox Films"},{"name":"Dimension Extreme"},{"name":"Dimension Films"}],"cast":["Steven Brand","Nick Eversman","Tracey Fairaway","Devon Sorvari","Stephan Smith Collins"],"backdrop_path":"https://image.tmdb.org/t/p/original/qv5zpQSx8naAm8C59DGVLMdZxbp.jpg","poster_path":"https://image.tmdb.org/t/p/original/mCDnf6Xlet2DihLHTt2pJRtmMfv.jpg","certification":"18","genres":["Terror"],"trailer":"N/A"},
"14522":{"id":"14522","name":"Beleza Negra","slug":"beleza-negra","original_title":"Black Beauty","overview":"No final do século passado, no pequeno estábulo da fazenda do Sr. Grey nasceu um potro com uma marca de nascença muito especial: uma estrela branca, bem no meio de sua testa. Negra era seu nome! Destinado a viver em um mundo sofrendo as mudanças do tempo, Beleza Negra fez vários amigos, como o simpático Jerry Barker e o jovem Joe Green, mas também muitos inimigos. Confiou em estranhos... Sobreviveu às armadilhas da natureza... E enfrentou todo o tipo de perigo... Sempre em busca de um lugar seguro, onde pudesse encontrar amor e carinho. Das belas paisagens do campo aos becos mais escuros de Londres, ele viveu a maior aventura de sua vida.","first_air_date":"1994-07-29","runtime":88,"episode_run_time":[88],"vote_average":6.7,"created_by":["Warner Bros. Pictures"],"production_companies":[{"name":"Warner Bros. Pictures"}],"cast":["Alan Cumming","Docs Keepin Time","Sean Bean","David Thewlis","Jim Carter"],"backdrop_path":"https://image.tmdb.org/t/p/original/o9AEP2Z8Ez1DlbYIrxJl2URj4L8.jpg","poster_path":"https://image.tmdb.org/t/p/original/5AjqXStGyXU9VpYqUHzEtxAIqJ9.jpg","certification":"N/A","genres":["Família","Aventura","Drama"],"trailer":"N/A"},
"13803":{"id":"13803","name":"Diversão Macabra","slug":"diversao-macabra","original_title":"Amusement","overview":"Enquanto é interrogada por um psiquiatra da polícia, a quase catatônica Tabitha tenta explicar por que ela e dois de seus amigos de infância estão sendo caçados por um serial killer. A verdade que está morrendo de vontade de sair tece três segredos trágicos de seu passado. Dois dos namorados das meninas tornam-se alvos involuntários em seu jogo mortal.","first_air_date":"2008-10-09","runtime":85,"episode_run_time":[85],"vote_average":5.6,"created_by":["Macari/Edelstein","Picturehouse Entertainment","New Line Cinema"],"production_companies":[{"name":"Macari/Edelstein"},{"name":"Picturehouse Entertainment"},{"name":"New Line Cinema"}],"cast":["Keir O'Donnell","Tad Hilgenbrink","Katheryn Winnick","Laura Breckenridge","Jessica Lucas"],"backdrop_path":"https://image.tmdb.org/t/p/original/tRzTQzQv27b85TbOJa7XO06Hvz0.jpg","poster_path":"https://image.tmdb.org/t/p/original/yZ8jybGYeLduReAV6CRwIAITAZZ.jpg","certification":"N/A","genres":["Terror","Mistério"],"trailer":"N/A"},
"29293":{"id":"29293","name":"House of the Dead 2","slug":"house-of-the-dead-2","original_title":"House of the Dead 2","overview":"Uma crescente infecção de zumbis toma conta de um isolado campus universitário. Com a esperança de parar a infecção e o fim da praga de zumbis, uma agência secreta do governo é enviada ao local para encontrar o Paciente Zero, o zumbi original que iniciou a infecção, e criar um antídoto. Já no campus, os agentes Alex (Emmanuelle Vaugier) e Ellis (Ed Quinn) percebem que a universidade inteira está contaminada. Em meio a uma gigantesca batalha com os zumbis, Alex e Ellis descobrem que alguns de seus colegas agentes têm seus próprios planos para o DNA zumbi.","first_air_date":"2006-02-11","runtime":95,"episode_run_time":[95],"vote_average":4.6,"created_by":["Lions Gate Films"],"production_companies":[{"name":"Lions Gate Films"}],"cast":["Emmanuelle Vaugier","Ed Quinn","Sticky Fingaz","Victoria Pratt","Theo Rossi"],"backdrop_path":"https://image.tmdb.org/t/p/original/xK3C4HHZRnJEK275WOl0mc4njrD.jpg","poster_path":"https://image.tmdb.org/t/p/original/puZzIRp9YI3O5Mxozk9NUHDdgjr.jpg","certification":"N/A","genres":["Terror","Cinema TV"],"trailer":"N/A"},
