"433945":{"id":"433945","name":"Tokyo Ghoul","slug":"tokyo-ghoul","original_title":"東京喰種 トーキョーグール","overview":"Em Tokyo, criaturas conhecidas como “Ghouls” vivem entre os humanos e os devoram para sobreviver. Alheio a eles, o jovem universitário Ken Kaneki leva uma vida pacata entre livros, até que um trágico encontro o coloca diante desses seres e o obriga a lutar por sua humanidade.","first_air_date":"2017-07-16","runtime":120,"episode_run_time":[120],"vote_average":7.1,"created_by":["Geek Sight"],"production_companies":[{"name":"Geek Sight"}],"cast":["Masataka Kubota","千眼美子","鈴木伸之","大泉洋","蒼井優"],"backdrop_path":"https://image.tmdb.org/t/p/original/pXeCJHw6iNoQn7eBXp6OPKvb2LS.jpg","poster_path":"https://image.tmdb.org/t/p/original/nmTztGsJIToPkdWbvTgQ4EY6SrR.jpg","certification":"16","genres":["Ação","Drama","Thriller"],"trailer":"nRvvhqTQuF0"},
"707103":{"id":"707103","name":"Emily","slug":"emily","original_title":"Emily","overview":"A vida imaginada de uma das autoras mais famosas do mundo, Emily Brontë, enquanto ela encontra sua voz e escreve o clássico literário O Morro dos Ventos Uivantes. Explore os relacionamentos que a inspiraram; sua irmandade crua e apaixonada com Charlotte e Anne; seu primeiro amor dolorido e proibido por Weightman e seu cuidado por seu irmão rebelde a quem ela idolatra.","first_air_date":"2022-10-14","runtime":130,"episode_run_time":[130],"vote_average":7.0,"created_by":["Tempo Productions","Arenamedia","Ingenious Media","Embankment Films"],"production_companies":[{"name":"Tempo Productions"},{"name":"Arenamedia"},{"name":"Ingenious Media"},{"name":"Embankment Films"}],"cast":["Emma Mackey","Fionn Whitehead","Oliver Jackson-Cohen","Alexandra Dowling","Gemma Jones"],"backdrop_path":"https://image.tmdb.org/t/p/original/7DrLrDf3vVVjgOGRUf37knUu7Rx.jpg","poster_path":"https://image.tmdb.org/t/p/original/tgVBMIiJczfBWINRRd9yxE8ESln.jpg","certification":"N/A","genres":["História","Drama","Romance"],"trailer":"WDSm6f0phg0"},
"10424":{"id":"10424","name":"Jennifer 8 - A Próxima Vítima","slug":"jennifer-8-a-proxima-vitima","original_title":"Jennifer Eight","overview":"Elas são vítimas não identificadas de uma onda de crimes insolúveis, mulheres ligadas pela hábil manipulação de um assassino... e catalogadas nos arquivos da polícia pelo código Jennifer . O investigador de homicídios, John Berlin acredita que achou a solução para o caso, quando descobre uma testemunha-chave: uma jovem cega chamada Helena. Mas, quem vai confiar no depoimento de alguém que não enxerga? Quem confiará em Berlin depois que ele se tornar um dos principais suspeitos? E quem conseguirá impedir que a frágil Helena seja a próxima Jennifer? Andy Garcia (Herói por Acidente) é Berlin e Uma Thurman (Desejos) é Helena, neste sufocante mistério, coestrelado por John Malkovich, Lance Henriksen e kathy Baker. Com grandes astros, muito suspense e um surpreendente final, não é de se estranhar que Jennifer 8 seja 10! (Bill Diehl, ABC Radio Network).","first_air_date":"1992-11-06","runtime":124,"episode_run_time":[124],"vote_average":6.1,"created_by":["Paramount Pictures"],"production_companies":[{"name":"Paramount Pictures"}],"cast":["Andy García","Lance Henriksen","Uma Thurman","Graham Beckel","Kathy Baker"],"backdrop_path":"https://image.tmdb.org/t/p/original/dAWlWircXrlnMjsVZSyb7vgMlIo.jpg","poster_path":"https://image.tmdb.org/t/p/original/pMlk8spEliRD6hr4ILs5ubHeBGT.jpg","certification":"N/A","genres":["Crime","Drama","Mistério","Thriller"],"trailer":"N/A"},
"10491":{"id":"10491","name":"Enigma","slug":"enigma","original_title":"Enigma","overview":"Em março de 1943, a equipe de elite dos decodificadores da Inglaterra tem uma responsabilidade monumental: decifrar o Enigma, um código ultraseguro utilizado pelos nazistas para enviar mensagens aos seus submarinos. O desafio fica ainda maior quando se sabe que uma grande esquadra de navios mercantis está prestes a cruzar o Atlântico e cerca de dez mil homens correrão perigo caso a localização dos submarinos alemães não seja logo descoberta, o que apenas poderá ocorrer quando o Enigma for decifrado. Para liderar este trabalho é chamado Tom Jericho (Dougray Scott), um gênio da matemática que consegue realizar tarefas consideradas impossíveis pelos especialistas. Porém, ao mesmo tempo em que Jericho se envolve cada vez mais com a decodificação do Enigma ele precisa estar atento à sua namorada Claire (Saffron Burrows), uma sedutora e misteriosa mulher que pode estar trabalhando como espiã para os alemães.","first_air_date":"2001-01-22","runtime":117,"episode_run_time":[117],"vote_average":6.4,"created_by":["Senator Film","Meespierson Film CV","Intermedia","Jagged Films","Broadway Video"],"production_companies":[{"name":"Senator Film"},{"name":"Meespierson Film CV"},{"name":"Intermedia"},{"name":"Jagged Films"},{"name":"Broadway Video"}],"cast":["Dougray Scott","Kate Winslet","Saffron Burrows","Jeremy Northam","Nikolaj Coster-Waldau"],"backdrop_path":"https://image.tmdb.org/t/p/original/pE334YKo9NNgee3VEGl6VR6gGSZ.jpg","poster_path":"https://image.tmdb.org/t/p/original/7gBFkDYBqvSzrPOWlpGTXRp97NQ.jpg","certification":"N/A","genres":["Mistério","Drama","Thriller","Romance","Guerra"],"trailer":"N/A"},
