"21253":{"id":"21253","name":"O Que é Isso, Companheiro?","slug":"o-que-e-isso-companheiro","original_title":"O Que é Isso, Companheiro?","overview":"O jornalista Fernando e seu amigo César abraçam a luta armada contra a ditadura militar no final da década de 60. Os dois se alistam num grupo guerrilheiro de esquerda. Em uma das ações do grupo militante, César é ferido e capturado pelos militares. Fernando então planeja o sequestro do embaixador dos Estados Unidos no Brasil, Charles Burke Elbrick, para negociar a liberdade de César e de outros companheiros presos.","first_air_date":"1997-10-01","runtime":110,"episode_run_time":[110],"vote_average":7.5,"created_by":["Miramax","Columbia TriStar"],"production_companies":[{"name":"Miramax"},{"name":"Columbia TriStar"}],"cast":["Alan Arkin","Pedro Cardoso","Fernanda Torres","Luiz Fernando Guimarães","Cláudia Abreu"],"backdrop_path":"https://image.tmdb.org/t/p/original/ii8OwoQp9UNu5uYQWXvS0IpC1XX.jpg","poster_path":"https://image.tmdb.org/t/p/original/biyck17TS3kjL0qVV1UiVHZkYQO.jpg","certification":"N/A","genres":["Thriller","Drama","História"],"trailer":"N/A"},
