"10642":{"id":"10642","name":"O Otário","slug":"o-otario","original_title":"Loser","overview":"Paul Tannek (Jason Biggs) é um jovem deslocado que vive num verdadeiro buraco na Universidade de Nova York. As garotas o rejeitam e os demais companheiros de faculdade simplesmente o ignoram. Até que ele conhece Dora Diamond (Mena Suvari), uma jovem estudante que é tão deslocada na cidade quanto ele. Dora não tem dinheiro nem lugar para morar, e seu namorado, o Professor Edward Alcott (Greg Kinnear), está mais interessado em manipulá-la do que em amá-la. Paul decide então ajudá-la a conseguir um emprego e a se vestir melhor, aprendendo ele mesmo a aproveitar melhor a cidade em que vive.","first_air_date":"2000-07-21","runtime":98,"episode_run_time":[98],"vote_average":5.4,"created_by":["Columbia Pictures"],"production_companies":[{"name":"Columbia Pictures"}],"cast":["Jason Biggs","Mena Suvari","Zak Orth","Thomas Sadoski","Jimmi Simpson"],"backdrop_path":"https://image.tmdb.org/t/p/original/r80VehB1GzdOReLSgr0N4iWo5id.jpg","poster_path":"https://image.tmdb.org/t/p/original/wKcKRuIIDPxlybaJhLBulmsqRBJ.jpg","certification":"N/A","genres":["Comédia","Romance"],"trailer":"N/A"},
"174751":{"id":"174751","name":"Em Busca da Justiça","slug":"em-busca-da-justica","original_title":"Jane Got a Gun","overview":"Jane Hammond (Natalie Portman, ganhadora do Oscar®, 2011, Melhor Atriz, “Cisne Negro”) construiu sua vida nas difíceis planícies do Oeste com o marido Bill “Ham” Hammond (Noah Emmerich) e a filha. Quando Ham volta para casa ferido a tiros depois de um embate como implacável John Bishop (Ewan McGregor) e sua gangue, ela sabe que eles não vão sossegar enquanto não matarem a família. Desesperada, Jane recorre a Dan Frost (Joel Edgerton), um homem do passado dela, para obter ajuda. Sob o tormento de antigas lembranças, o passado de Jane se encontra com o presente, numa batalha emocionante pela sobrevivência.","first_air_date":"2015-12-31","runtime":98,"episode_run_time":[98],"vote_average":5.8,"created_by":["1821 Pictures","Handsomecharlie Films","Scott Pictures","Straight Up Films","Unanimous Pictures"],"production_companies":[{"name":"1821 Pictures"},{"name":"Handsomecharlie Films"},{"name":"Scott Pictures"},{"name":"Straight Up Films"},{"name":"Unanimous Pictures"}],"cast":["Natalie Portman","Joel Edgerton","Ewan McGregor","Noah Emmerich","Boyd Holbrook"],"backdrop_path":"https://image.tmdb.org/t/p/original/xXYIWoQLxToV9gzCgmQ1LpgU96X.jpg","poster_path":"https://image.tmdb.org/t/p/original/eAqBjWgs67vzh5JhNFvIsj284G9.jpg","certification":"16","genres":["Faroeste","Ação","Drama"],"trailer":"N/A"},
