"458737":{"id":"458737","name":"No Coração da Escuridão","slug":"no-coracao-da-escuridao","original_title":"First Reformed","overview":"O ex-militar capelão Toller sofre pela perda do filho que ele encorajou a se alistar nas forças armadas. Um outro desafio começa quando ele faz amizade com a jovem paroquiana Mary e seu marido, que é um ambientalista radical. Toller logo descobre segredos escondidos de sua igreja com relação a empresas inescrupulosas.","first_air_date":"2018-05-18","runtime":113,"episode_run_time":[113],"vote_average":7.0,"created_by":["Arclight Films","Omeira Studio Partners","Killer Films","Fibonacci Films","Big Indie Pictures"],"production_companies":[{"name":"Arclight Films"},{"name":"Omeira Studio Partners"},{"name":"Killer Films"},{"name":"Fibonacci Films"},{"name":"Big Indie Pictures"}],"cast":["Ethan Hawke","Amanda Seyfried","Cedric the Entertainer","Victoria Hill","Philip Ettinger"],"backdrop_path":"https://image.tmdb.org/t/p/original/oXNtdwoRsG9MIpOjJHeT4xGjwbV.jpg","poster_path":"https://image.tmdb.org/t/p/original/21Ijbx7CPOiUffwm33migWz5EvH.jpg","certification":"16","genres":["Drama"],"trailer":"N/A"},
"542":{"id":"542","name":"O Crime do Padre Amaro","slug":"o-crime-do-padre-amaro","original_title":"El Crimen del Padre Amaro","overview":"O jovem padre Amaro acaba de ser ordenado e em breve irá para Roma continuar seus estudos, graças à boa relação que mantém com o bispo. Antes, contudo, deve trabalhar em uma paróquia. Ele é enviado para Los Reyes para atuar sob as ordens do padre Benito, o vigário que aparentemente vive uma existência corrupta e contraditória. Lá Amaro conhece a linda e devota Amelia, filha de Sanjuanera, dona do restaurante mais importante da cidade e amante do padre Benito. Diante do mundo real, Amaro é confrontado com a hipocrisia da Igreja, que condena as guerrilhas mas convive com chefes do tráfico de drogas.","first_air_date":"2002-10-01","runtime":118,"episode_run_time":[118],"vote_average":6.6,"created_by":["Instituto Mexicano de Cinematografía","Alameda Films","Cinecolor-México","Cinecolor-Argentina","Artcam y Fonds Sud Cinéma"],"production_companies":[{"name":"Instituto Mexicano de Cinematografía"},{"name":"Alameda Films"},{"name":"Cinecolor-México"},{"name":"Cinecolor-Argentina"},{"name":"Artcam y Fonds Sud Cinéma"}],"cast":["Gael García Bernal","Ana Claudia Talancón","Sancho Gracia","Angélica Aragón","Ernesto Gómez Cruz"],"backdrop_path":"https://image.tmdb.org/t/p/original/pH4MhQJK12l8lT6DCpNy0Lu8Wub.jpg","poster_path":"https://image.tmdb.org/t/p/original/eo60rPzqAjEvv5EPZINGBx7BU7a.jpg","certification":"16","genres":["Drama","Romance"],"trailer":"N/A"},
"7341":{"id":"7341","name":"A Maldição de Carrie","slug":"a-maldicao-de-carrie","original_title":"The Rage: Carrie 2","overview":"Há vinte e três anos a telecinética Carrie White foi humilhada em um baile no seu colégio. Carrie foi tomada de um ódio tão intenso que imaginou que todos debochavam dela, quando na verdade apenas alguns a estavam humilhando. Usando seus poderes paranormais, ela fechou as portas e incendeou o ginásio, matando todos, com exceção de Sue Snell (Amy Irving). Em 1999, a situação começa a se repetir, quando Rachel Lang (Emily Bergl), a meia-irmã de Carrie que também telecinética e menosprezada por seus colegas, está prestes a ir em um baile sem que ninguém tenha idéia de seus poderes. Entretanto, Sue Snell, que agora conselheira da escola, desconfia que Rachel tem o mesmo dom de Carrie e teme que uma tragédia similar possa acontecer, tentando inutilmente advertir Rachel sobre isto. Paralelamente, alguns alunos do colégio planejam para a noite do baile algo que Rachel nunca vai esquecer, sem imaginar que eles vão morrer antes que esta mesma noite termine.","first_air_date":"1999-03-12","runtime":104,"episode_run_time":[104],"vote_average":5.6,"created_by":["United Artists","Red Bank Films","Metro-Goldwyn-Mayer"],"production_companies":[{"name":"United Artists"},{"name":"Red Bank Films"},{"name":"Metro-Goldwyn-Mayer"}],"cast":["Emily Bergl","Jason London","Amy Irving","J. Smith-Cameron","Dylan Bruno"],"backdrop_path":"https://image.tmdb.org/t/p/original/t7pSeeXqVEgGpVloWQZdzlh7fyS.jpg","poster_path":"https://image.tmdb.org/t/p/original/cYyVRSZZohW9lxXU1XTTzde6Vca.jpg","certification":"N/A","genres":["Terror","Thriller","Ficção científica"],"trailer":"N/A"},
