"10657":{"id":"10657","name":"Trocas Macabras","slug":"trocas-macabras","original_title":"Needful Things","overview":"Castle Rock, na Nova Inglaterra, é um lugar tranquilo para se viver. Mas a chegada de Leland Gaunt, um ser diabólico literalmente falando, desestabiliza a cidade através do preconceito, ódio, fraqueza e cobiça, provocando mortes e sofrimentos. Gaunt consegue isto através de uma loja de utilidades, que sempre tem algo especial para cada morador da cidade, que para conseguirem o que desejam pagam um preço simbólico e prestam um \"favor\" para Leland.","first_air_date":"1993-08-27","runtime":120,"episode_run_time":[120],"vote_average":6.2,"created_by":["New Line Cinema","Castle Rock Entertainment"],"production_companies":[{"name":"New Line Cinema"},{"name":"Castle Rock Entertainment"}],"cast":["Max von Sydow","Ed Harris","Bonnie Bedelia","Amanda Plummer","J. T. Walsh"],"backdrop_path":"https://image.tmdb.org/t/p/original/cFm73y9i3ijvlQIgp5o1vzRVHQv.jpg","poster_path":"https://image.tmdb.org/t/p/original/9WpKm32evZP603b0gBCI1pS1hlg.jpg","certification":"N/A","genres":["Drama","Terror"],"trailer":"N/A"},
