"487437":{"id":"487437","name":"Branca Como a Neve","slug":"branca-como-a-neve","original_title":"Blanche comme neige","overview":"Claire é uma bela jovem que trabalha no hotel de seu falecido pai. O local agora é administrado por sua madrasta má, Maud. Claire inconscientemente desperta ciúme incontrolável em Maud, cujo jovem amante se apaixonou pela bela enteada. A madrasta decide então se livrar de Claire, que consegue fugir e com a ajuda de um homem misterioso. Ele a leva para a sua fazenda dele, em uma pequena aldeia, onde ela causa bastante agitação: um, dois, e logo sete \"príncipes\" acabam cativados pelo seu charme. Para Claire, este é o começo de uma emancipação radical, tanto romântica quanto carnal.","first_air_date":"2019-04-10","runtime":112,"episode_run_time":[112],"vote_average":5.1,"created_by":["Ciné-@","Mandarin Cinéma"],"production_companies":[{"name":"Ciné-@"},{"name":"Mandarin Cinéma"}],"cast":["Isabelle Huppert","Lou de Laâge","Vincent Macaigne","Charles Berling","Pablo Pauly"],"backdrop_path":"https://image.tmdb.org/t/p/original/e7kMJtCtrVLjaaGaKsjq0kEF1YF.jpg","poster_path":"https://image.tmdb.org/t/p/original/6tkBLz4HEOiuiTQbEombtRjvfj4.jpg","certification":"N/A","genres":["Comédia","Drama"],"trailer":"DrxcfWmhfDo"},
