"19255":{"id":"19255","name":"Distante nós Vamos","slug":"distante-nos-vamos","original_title":"Away We Go","overview":"Burt e Verona são um casal apaixonado, vivendo a experiência de esperar o primeiro filho. Aos 6 meses da gravidez, eles säo surpreendidos por uma má notícia: os pais de Burt vão passar dois anos na Bélgica. Como os pais de Verona já são falecidos, eles decidem viajar pelos Estados Unidos e Canadá para rever outros parentes e velhos amigos e encontrar o lugar perfeito para começar uma família.","first_air_date":"2009-06-05","runtime":98,"episode_run_time":[98],"vote_average":6.6,"created_by":["Focus Features","Big Beach","Neal Street Productions","Edward Saxon Productions"],"production_companies":[{"name":"Focus Features"},{"name":"Big Beach"},{"name":"Neal Street Productions"},{"name":"Edward Saxon Productions"}],"cast":["John Krasinski","Maya Rudolph","Carmen Ejogo","Catherine O'Hara","Jeff Daniels"],"backdrop_path":"https://image.tmdb.org/t/p/original/rSEZ4e8rWCk9SsRvuwyxtLLUV0w.jpg","poster_path":"https://image.tmdb.org/t/p/original/4xnbZXgqGjlKDCio7yJ7mOLZVR5.jpg","certification":"N/A","genres":["Drama","Comédia","Romance"],"trailer":"N/A"},
"214314":{"id":"214314","name":"Ursos","slug":"ursos","original_title":"Bears","overview":"Apresentando um ano na vida de uma família de ursos, onde a mãe ensina seus dois impressionáveis filhotes as lições mais importantes da vida. Situado em um cenário majestoso do Alasca, sua jornada começa quando o inverno termina. Emergindo da hibernação, os três enfrentam o emocionante e muito arriscado mundo exterior. Surpreendente captura de imagens de uma família carinhosa aprendendo a viver a vida ao máximo, em uma das últimas grandes regiões selvagens do planeta. (e Livre - Estimado Livre)","first_air_date":"2014-04-17","runtime":78,"episode_run_time":[78],"vote_average":7.4,"created_by":["Disneynature"],"production_companies":[{"name":"Disneynature"}],"cast":["John C. Reilly"],"backdrop_path":"https://image.tmdb.org/t/p/original/8dqdWKHbrFTQj0ttq6AdwWkUYeU.jpg","poster_path":"https://image.tmdb.org/t/p/original/9Uh2r3hf8Lfl0R2bHLbbuN3D2tZ.jpg","certification":"N/A","genres":["Documentário"],"trailer":"N/A"},
