"52505":{"id":"52505","name":"As Coisas Impossíveis do Amor","slug":"as-coisas-impossiveis-do-amor","original_title":"The Other Woman","overview":"Emilia é uma advogada recém-formada e uma mulher recém-casada com Jack, que era seu chefe na época em que se conheceram e já era casado. Infelizmente, sua vida toma um rumo inesperado quando Jack e Emilia perdem a sua filha recém-nascida e ela passa a lutar para superar a dor para poder criar um laço afetivo com seu enteado William. Ao mesmo tempo, ela também tenta superar suas divergências com seu pai, causadas por sua própria infidelidade. Mas talvez o obstáculo mais difícil de todos para Emilia sejam as constantes interferências da ciumenta e rancorosa ex-mulher de seu marido, Carolyn. Com o passar do tempo, as insistentes tentativas de Charlie e William em fazer com que Emilia abra seu coração começam a funcionar.Será que ela pode redescobrir sua própria capacidade de amar a tempo de salvar seu casamento e consertar seu relacionamento com seus pais e construir uma família a partir dos destroços?","first_air_date":"2010-10-28","runtime":98,"episode_run_time":[98],"vote_average":6.2,"created_by":["Handsomecharlie Films","Marc Platt Productions","Is or Isn't Entertainment"],"production_companies":[{"name":"Handsomecharlie Films"},{"name":"Marc Platt Productions"},{"name":"Is or Isn't Entertainment"}],"cast":["Natalie Portman","Scott Cohen","Charlie Tahan","Lauren Ambrose","Lisa Kudrow"],"backdrop_path":"https://image.tmdb.org/t/p/original/nCKebrEB0kTPN10NUxoHumMTsnM.jpg","poster_path":"https://image.tmdb.org/t/p/original/yQbdra6eqLgqUkm2XX4ddTksSJw.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
