"432616":{"id":"432616","name":"Promessa ao Amanhecer","slug":"promessa-ao-amanhecer","original_title":"La Promesse de l'aube","overview":"De sua infância difícil na Polônia, passando por sua adolescência sob o sol de Nice, até suas proezas como aviador durante a Segunda Guerra Mundial, Romain Gary viveu uma vida extraordinária. Mas essa ânsia por viver mil vidas e se tornar um grande homem, ele deve a Nina, sua mãe. É o amor louco dessa mãe cativante e excêntrica que fará dele um dos maiores romancistas do século XX. Mas esse amor materno, sem limites, também será seu fardo por toda vida.","first_air_date":"2017-12-20","runtime":130,"episode_run_time":[130],"vote_average":7.3,"created_by":["Nexus Factory"],"production_companies":[{"name":"Nexus Factory"}],"cast":["Pierre Niney","Charlotte Gainsbourg","Didier Bourdon","Jean-Pierre Darroussin","Finnegan Oldfield"],"backdrop_path":"https://image.tmdb.org/t/p/original/7xNRB4UWJhvxz4hUuSbhb8PGDdx.jpg","poster_path":"https://image.tmdb.org/t/p/original/eKpr5YuYnATcDjbVxzJmtEvAWw5.jpg","certification":"N/A","genres":["Drama","Romance","História","Guerra"],"trailer":"N/A"},
