"374475":{"id":"374475","name":"Toni Erdmann","slug":"toni-erdmann","original_title":"Toni Erdmann","overview":"Winfried (Peter Simonischek) é um senhor que gosta de levar a vida com bom humor, fazendo brincadeiras que proporcionem o riso nas pessoas. Seu jeito extrovertido fez com que se afastasse de sua filha, Ines (Sandra Hüller), sempre sisuda e extremamente dedicada ao trabalho. Percebendo o afastameto, Winfried decide visitar a filha na cidade em que ela mora, Budapeste. A iniciativa não dá certo, resultando em vários enfrentamentos entre pai e filha, o que faz com que ele volte para casa. Tempos depois, Winfried ressurge na vida de Ines sob o alter-ego de Toni Erdmann, especialista em contar mentiras bem-intencionadas a todos que ela conhece.","first_air_date":"2016-07-14","runtime":162,"episode_run_time":[162],"vote_average":7.0,"created_by":["Komplizen Film","KNM","Missing Link Films","Coop99 Filmproduktion","HiFilm Productions","MonkeyBoy"],"production_companies":[{"name":"Komplizen Film"},{"name":"KNM"},{"name":"Missing Link Films"},{"name":"Coop99 Filmproduktion"},{"name":"HiFilm Productions"},{"name":"MonkeyBoy"}],"cast":["Sandra Hüller","Peter Simonischek","Michael Wittenborn","Thomas Loibl","Trystan Pütter"],"backdrop_path":"https://image.tmdb.org/t/p/original/dwBdfo10gulOpTpmlJMczr5GhZ6.jpg","poster_path":"https://image.tmdb.org/t/p/original/tI5WltGXru8ze66jN1VgJaZZZjh.jpg","certification":"16","genres":["Comédia","Drama"],"trailer":"jnkCzL62QjQ"},
"10416":{"id":"10416","name":"De Que Planeta Você Veio?","slug":"de-que-planeta-voce-veio","original_title":"What Planet Are You From?","overview":"O alienígena Harold (Shandling) é enviado à Terra para salvar seu planeta que é habitado apenas por homens. Sua missão é procriar com uma terráquea. Mas ele está mundos de compreender o sexo oposto. E, a cada mulher que conhece, ele passa por uma dificuldade técnica: seu “membro” faz um zunido quando ele está excitado. E o seu estranho comportamento social não ajuda em nada. Despertando as suspeitas de um oficial (John Goodman) e seu desleal colega de trabalho (Greg Kinnear), a missão de Harold parece impossível. Mas as aventuras amorosas desse divertido extraterrestre passam a ter uma nova perspectiva quando ele conhece a Srta. Right (Annette Bening).","first_air_date":"2000-03-03","runtime":104,"episode_run_time":[104],"vote_average":5.5,"created_by":["Columbia Pictures","Brillstein-Grey Entertainment"],"production_companies":[{"name":"Columbia Pictures"},{"name":"Brillstein-Grey Entertainment"}],"cast":["Garry Shandling","Annette Bening","John Goodman","Greg Kinnear","Ben Kingsley"],"backdrop_path":"https://image.tmdb.org/t/p/original/kaH2D6SnJQHeOeNwnkjOac6Gt9j.jpg","poster_path":"https://image.tmdb.org/t/p/original/2VtgMZPj3uDLz0zOQqZ74SUZGK4.jpg","certification":"N/A","genres":["Comédia","Drama","Romance","Ficção científica"],"trailer":"N/A"},
