"539617":{"id":"539617","name":"Amizade Adolescente","slug":"amizade-adolescente","original_title":"Big Time Adolescence","overview":"Enquanto passa por um forte período de amadurecimento em sua vida, um jovem suburbano conta com as estranhas e destrutivas tentativas de ajuda de seu melhor amigo: um desistente da escola completamente diferente dele. Juntos, eles passam por uma longa jornada de conhecimento interior e percebem que ser adulto é muito mais complicado do que parece.","first_air_date":"2020-03-13","runtime":91,"episode_run_time":[91],"vote_average":7.2,"created_by":["American High","LD Entertainment"],"production_companies":[{"name":"American High"},{"name":"LD Entertainment"}],"cast":["Griffin Gluck","Pete Davidson","Jon Cryer","Sydney Sweeney","Emily Arlook"],"backdrop_path":"https://image.tmdb.org/t/p/original/2DwSRqFuqZoGqbJVkuAFsulYVQA.jpg","poster_path":"https://image.tmdb.org/t/p/original/p0qPZ9LmE9hXkIdDhAqicXBDIWh.jpg","certification":"16","genres":["Comédia","Drama"],"trailer":"N/A"},
"10513":{"id":"10513","name":"Plano 9 do Espaço Sideral","slug":"plano-9-do-espaco-sideral","original_title":"Plan 9 from Outer Space","overview":"Uma dupla de alienígenas que estava irritada com as \"estúpidas mentes\" do planeta Terra, faz sua base em um cemitério da Califórnia, pois planejavam através do \"Plano 9\", que se refere a um eletrodo de longa distância que é colocado nas glândulas pineal e pituitária dos mortos, criar um exército de zumbis que marchassem para conquistar as capitais do mundo. O fato de ressuscitarem só três mortos não os desencoraja. Jeff Trent (Gregory Walcott), um piloto de uma linha aérea que vive perto do cemitério precisa salvar Paula (Mona McKinnon), sua mulher, destes seres.","first_air_date":"1959-07-22","runtime":79,"episode_run_time":[79],"vote_average":4.2,"created_by":["Reynolds Pictures"],"production_companies":[{"name":"Reynolds Pictures"}],"cast":["Gregory Walcott","Mona McKinnon","Duke Moore","Tom Keene","Carl Anthony"],"backdrop_path":"https://image.tmdb.org/t/p/original/9pHCAT1ScILdkhY8ErfOma8W4kB.jpg","poster_path":"https://image.tmdb.org/t/p/original/riPH2fbt5NunK8gEtrjfWIEsrYz.jpg","certification":"N/A","genres":["Ficção científica","Terror"],"trailer":"N/A"},
"359364":{"id":"359364","name":"Humano: Uma Viagem Pela Vida","slug":"humano-uma-viagem-pela-vida","original_title":"Human","overview":"Com testemunhos e imagens aéreas exclusivas, o introspectivo documentário aborda quem nós somos hoje em dia. Não só como comunidade, mas como indivíduos. Através das guerras, descriminações e desigualdades, confrontamos a realidade que também contempla discursos de solidariedade. Uma reflexão do futuro que queremos para nós, seres humanos, e o planeta.","first_air_date":"2015-09-12","runtime":191,"episode_run_time":[191],"vote_average":8.5,"created_by":["Humankind Production"],"production_companies":[{"name":"Humankind Production"}],"cast":[],"backdrop_path":"https://image.tmdb.org/t/p/original/c0gtBfDyOrba9e5wnFjrxn8rxQr.jpg","poster_path":"https://image.tmdb.org/t/p/original/trJpgBNXxlAfUdMfeipC9XZS8oJ.jpg","certification":"12","genres":["Documentário"],"trailer":"N5lKHo2754A"},
