"10765":{"id":"10765","name":"A Recruta Benjamin","slug":"a-recruta-benjamin","original_title":"Private Benjamin","overview":"A Recruta Benjamin, traz a consagrada comediante Goldie Hawn no filme que lhe deu uma indicação ao OSCAR de melhor atriz de 1980. Ela é a jovem e bela viúva Judy Benjamin, que responde a um sedutor anúncio alistando-se no exército americano. O difícil treinamento, seus problemas de adaptação e seus conflitos com a inflexível Capitã Lewis (Eileen Breenan, indicada ao OSCAR de Melhor Atriz Coadjuvante por esta personagem), retratados com muito humor em um filme verdadeiramente hilariante.","first_air_date":"1980-10-06","runtime":109,"episode_run_time":[109],"vote_average":5.9,"created_by":["Warner Bros. Pictures"],"production_companies":[{"name":"Warner Bros. Pictures"}],"cast":["Goldie Hawn","Eileen Brennan","Armand Assante","Robert Webber","Sam Wanamaker"],"backdrop_path":"https://image.tmdb.org/t/p/original/bMWO0HQwfIe85CmXbWSI8Q6cCC2.jpg","poster_path":"https://image.tmdb.org/t/p/original/fs2bTvbMsTgotMD10kC7MTKBIHm.jpg","certification":"N/A","genres":["Comédia"],"trailer":"N/A"},
"10349":{"id":"10349","name":"A Metade Negra","slug":"a-metade-negra","original_title":"The Dark Half","overview":"Um escritor bestseller, Thad Beaumont (Hutton) é chantageado por um vigarista que ameaça lhe delatar o pseudônimo que usa nos livros, George Stark. Disposto a não aceitar as ameaças do meliante, Beaumont decide ele mesmo revelar-se publicamente, até mesmo com um “enterro” simbólico de Stark. A partir daí estranhos e violentos assassinatos são cometidos (a começar pelo jornalista e fotógrafo que se encarregaram da reportagem), sempre precedidos de uma revoada de pardais.","first_air_date":"1993-04-23","runtime":122,"episode_run_time":[122],"vote_average":6.0,"created_by":["George A. Romero Productions","Orion Pictures"],"production_companies":[{"name":"George A. Romero Productions"},{"name":"Orion Pictures"}],"cast":["Timothy Hutton","Amy Madigan","Michael Rooker","Julie Harris","Robert Joy"],"backdrop_path":"https://image.tmdb.org/t/p/original/2zmWw02NpZp8t3gDNQeKKu2yaQN.jpg","poster_path":"https://image.tmdb.org/t/p/original/aotrwjI1FsG4j2PVhl9tfxnXiRq.jpg","certification":"N/A","genres":["Mistério","Terror"],"trailer":"N/A"},
