"531380":{"id":"531380","name":"O Golpe De Ouro","slug":"o-golpe-de-ouro","original_title":"黃金兄弟","overview":"Ex-mercenários de Hong Kong se juntam para um golpe: roubar um carregamento de medicamentos a ser doado para um campo de refugiados africanos. Quando finalmente conseguem, descobrem que se trata de ouro: foram enganados por alguém e a missão agora acarreta outros riscos.","first_air_date":"2018-09-20","runtime":100,"episode_run_time":[100],"vote_average":6.3,"created_by":["Art Top Movie Productions","Jing's Production Limited","Golden Network Asia"],"production_companies":[{"name":"Art Top Movie Productions"},{"name":"Jing's Production Limited"},{"name":"Golden Network Asia"}],"cast":["鄭伊健","陳小春","謝天華","錢嘉樂","林曉峰"],"backdrop_path":"https://image.tmdb.org/t/p/original/w1lCa89i9fLmoujCxH3jUP0gvSj.jpg","poster_path":"https://image.tmdb.org/t/p/original/6Ja7E1FxVRtQY0i0sOslbBCAzu2.jpg","certification":"N/A","genres":["Ação","Aventura","Crime"],"trailer":"N/A"},
"4786":{"id":"4786","name":"Rudo e Cursi - A Vida é uma Viagem","slug":"rudo-e-cursi-a-vida-e-uma-viagem","original_title":"Rudo y Cursi","overview":"Beto (Diego Luna) e Tato (Gael García Bernal) são irmãos que largaram a vida de camponeses para tentar a sorte nos campos de futebol. Apensar do sonho fraterno de construir uma casa para a mãe, os dois vivem em disputa, dentro e fora do campo, numa relação de amor e ódio. O sucesso vem quando um olheiro descobre seus talentos. Tato, que sonha ser um cantor famoso, muda-se para a cidade e se torna a estrela do Deportivo Amaranto, e passa a ser chamado de \"Cursi\". Beto, que recebe o apelido de \"Rudo\", se sente traído, mas logo acaba como goleiro. Em breve estarão num mundo de luxo, fama e lindas mulheres. Nessa nova realidade, parecem ter deixado de lado as diferenças. Mas, quando estão a ponto de realizar seus sonhos, ressurgem as rivalidades, medos e limitações. \"Rudo Y Cursi\" é um filme emocionante dirigido por Carlos Cuarón e produzido por uma equipe agora famosa em Hollywood: Guilherme Del Toro; Alejandro González Iñárritu e Alfonso Cuarón.","first_air_date":"2008-12-19","runtime":102,"episode_run_time":[102],"vote_average":7.1,"created_by":["Focus Features","Cha Cha Chá","Universal Pictures"],"production_companies":[{"name":"Focus Features"},{"name":"Cha Cha Chá"},{"name":"Universal Pictures"}],"cast":["Gael García Bernal","Diego Luna","Guillermo Francella","Dolores Heredia","Adriana Paz"],"backdrop_path":"https://image.tmdb.org/t/p/original/bmjo4w9MoLag2BjayBIHCAl0w0e.jpg","poster_path":"https://image.tmdb.org/t/p/original/xFGuhPSe1mCRcOllLlJYoNUknNt.jpg","certification":"N/A","genres":["Comédia","Drama"],"trailer":"N/A"},
"203739":{"id":"203739","name":"Academia de Vampiros: O Beijo das Sombras","slug":"academia-de-vampiros-o-beijo-das-sombras","original_title":"Vampire Academy","overview":"Conta a lenda de Rose Hathaway e Lissa Dragomir, duas garotas de 17 anos que frequentam uma escola para Moroi (vampiros mortais e pacíficos) e Dhampir (meio-vampiros / meio-humanos e guardiões dos Moroi). Rose, uma Dhampir rebelde e guardiã em treinamento, e sua melhor amiga, Lissa – uma princesa Moroi – estavam em fuga e foram capturadas e devolvidas à Academia de St. Vladimir, o lugar que elas acreditam estar colocando suas vidas em risco. De volta aos perigos da sociedade Moroi e do colegial, Lissa tenta retomar seu status, enquanto Rose treina com seu guardião e mentor Dimitri, para garantir seu lugar como a guardiã de Lissa. Rose sacrificará o que for preciso para proteger Lissa dos que pretendem explorá-la dentro dos domínios da Academia e também dos Strigoi (vampiros maus e imortais), que caçam sua espécie.","first_air_date":"2014-02-07","runtime":104,"episode_run_time":[104],"vote_average":6.3,"created_by":["Montford / Murphy Productions","Preger Entertainment"],"production_companies":[{"name":"Montford / Murphy Productions"},{"name":"Preger Entertainment"}],"cast":["Zoey Deutch","Lucy Fry","Данила Козловский","Gabriel Byrne","Dominic Sherwood"],"backdrop_path":"https://image.tmdb.org/t/p/original/7Ijb0PDkuL3GK2IHLLIs9acURM8.jpg","poster_path":"https://image.tmdb.org/t/p/original/o6vXekbF356LhfJY67KYPKZWxq5.jpg","certification":"14","genres":["Comédia","Ação","Fantasia"],"trailer":"N/A"},
