"10620":{"id":"10620","name":"Era Uma Vez na China e na América","slug":"era-uma-vez-na-china-e-na-america","original_title":"黃飛鴻之西域雄獅","overview":"Jet Li interpreta Wong Fei Hong, um lendário justiceiro chinês em vista a América que após sofrer um grava acidente, é salvo por uma tribo de índios. Usando toda sua habilidade e técnica nas artes marciais, Wong ajuda seus amigos a derrotarem uma tribo inimiga e, após o combate, descobre que trabalhadores chineses estão sendo explorados por um tirano que governa o local. Assim, resolve ficar e lutar para libertar seu povo.","first_air_date":"1997-02-01","runtime":102,"episode_run_time":[102],"vote_average":5.8,"created_by":["Win's Entertainment Ltd.","China Star Entertainment"],"production_companies":[{"name":"Win's Entertainment Ltd."},{"name":"China Star Entertainment"}],"cast":["Jet Li","關之琳","熊欣欣","陳國邦","Jeff Wolfe"],"backdrop_path":"https://image.tmdb.org/t/p/original/3ifKXbBHTtJeNfdPk8FJMjRymzw.jpg","poster_path":"https://image.tmdb.org/t/p/original/urmlXOmvSH9dxNv6LIaGpgBhu0f.jpg","certification":"12","genres":["Ação","Faroeste"],"trailer":"N/A"},
