"13825":{"id":"13825","name":"Entre a Vida e a Morte","slug":"entre-a-vida-e-a-morte","original_title":"The Lazarus Project","overview":"Dallas, Texas. Ben Garvey (Paul Walker) leva uma vida simples ao lado de sua esposa Lisa (Piper Perabo) e a filha Katie (Garvey Brooklyn). Ele trabalha duro no Fort Garry Brewery Company, mas ainda está em período de experiência. É quando recebe a visita de seu irmão Ricky (Shawn Hatosy), que acabou de deixar a prisão. Ele oferece a Ben a oportunidade de participar do roubo de 12 kg de ouro em pó, pertencentes a um laboratório. Ben inicialmente recusa a proposta, mas após ser demitido volta atrás e a aceita. Só que tudo dá errado, já que Ricky, seu parceiro Phelps (Alex Sol) e um segurança são mortos. Ben é condenado pelas mortes, sendo sentenciado à morte por uma injeção letal. Após a execução, Ben subitamente desperta em uma comunidade localizada em Dundee, no Oregon. O responsável pelo feito é o padre Ezra (Bob Gunton), que lhe diz que sua vida anterior é passado e agora tem em mãos uma segunda chance.","first_air_date":"2008-10-24","runtime":99,"episode_run_time":[99],"vote_average":6.0,"created_by":["Scion Films","Be Good Productions","Mandeville Films","Inferno Distribution"],"production_companies":[{"name":"Scion Films"},{"name":"Be Good Productions"},{"name":"Mandeville Films"},{"name":"Inferno Distribution"}],"cast":["Paul Walker","Piper Perabo","Lambert Wilson","Linda Cardellini","Shawn Hatosy"],"backdrop_path":"https://image.tmdb.org/t/p/original/g3aLgQI4aw7aCucYSqXM4CzNYMu.jpg","poster_path":"https://image.tmdb.org/t/p/original/g8f3M4yWVbLZYJMkb1ZjMxyiw1B.jpg","certification":"12","genres":["Drama","Thriller"],"trailer":"N/A"},
"504585":{"id":"504585","name":"Little Joe","slug":"little-joe","original_title":"Little Joe","overview":"Alice é uma jovem mãe solo e uma dedicada criadora de plantas em uma empresa focada em desenvolver novas espécies. Ela é responsável por criar uma flor que não só é bela, mas também tem incríveis habilidades terapêuticas. Se bem cuidada, a planta deixa seu dono feliz. Quando Alice desobedece regras da empresa e leva uma das flores para seu filho, ela começa a perceber que sua criação pode não ser tão benévola quanto parece.","first_air_date":"2019-11-01","runtime":106,"episode_run_time":[106],"vote_average":5.7,"created_by":["The Bureau","Essential Filmproduktion","ORF","BBC Film","BR","ARTE","Coop99 Filmproduktion"],"production_companies":[{"name":"The Bureau"},{"name":"Essential Filmproduktion"},{"name":"ORF"},{"name":"BBC Film"},{"name":"BR"},{"name":"ARTE"},{"name":"Coop99 Filmproduktion"}],"cast":["Emily Beecham","Ben Whishaw","Kerry Fox","Kit Connor","David Wilmot"],"backdrop_path":"https://image.tmdb.org/t/p/original/jnq1lg6Fd8b6pn5ud5hVFS2hSyf.jpg","poster_path":"https://image.tmdb.org/t/p/original/xx5M3DkJaRfKPySib4DFyCsCOIm.jpg","certification":"N/A","genres":["Drama","Ficção científica"],"trailer":"N/A"},
"492565":{"id":"492565","name":"Billy The Kid: O Fora da Lei","slug":"billy-the-kid-o-fora-da-lei","original_title":"The Kid","overview":"No Velho Oeste, Rio Cutler é um jovem garoto que mata o pai para proteger a mãe da violência dentro de casa. Quando seu tio Grant descobre, ele inicia uma violenta caçada pelo menino que foge com a irmã Sara. Logo, a dupla se vê em meio a um embate memorável entre o fora da lei Billy 'The Kid' e o xerife Pat Garrett, deixando tudo ainda mais caótico.","first_air_date":"2019-03-08","runtime":100,"episode_run_time":[100],"vote_average":6.0,"created_by":["Suretone Pictures","Mimran Schur Pictures"],"production_companies":[{"name":"Suretone Pictures"},{"name":"Mimran Schur Pictures"}],"cast":["Ethan Hawke","Dane DeHaan","Jake Schur","Leila George","Adam Baldwin"],"backdrop_path":"https://image.tmdb.org/t/p/original/qogeijTQKJB3XtopMolADVQcnBG.jpg","poster_path":"https://image.tmdb.org/t/p/original/2vlhQKwzEPoZC5cTfzLHrmKjbsk.jpg","certification":"16","genres":["Faroeste","Drama","Ação"],"trailer":"N/A"},
"464593":{"id":"464593","name":"Terra: Um Dia Incrível","slug":"terra-um-dia-incrivel","original_title":"Earth: One Amazing Day","overview":"One Amazing Day, uma viagem surpreendente que revela o incrível poder do mundo natural. Ao longo de um único dia, rastreamos o sol das montanhas mais altas até as ilhas mais remotas de selvas exóticas. As descobertas na tecnologia de cinema trazem você para perto com um elenco de personagens inesquecíveis. Contado com humor, intimidade e sensação de esplendor cinematográfico, Earth: One Amazing Day ressalta como cada dia está cheio de mais maravilhas do que você pode imaginar, até agora.","first_air_date":"2017-08-04","runtime":95,"episode_run_time":[95],"vote_average":7.7,"created_by":["Earth Film Productions","Mandarin Film","BBC Earth","SMG Pictures","Goldcrest"],"production_companies":[{"name":"Earth Film Productions"},{"name":"Mandarin Film"},{"name":"BBC Earth"},{"name":"SMG Pictures"},{"name":"Goldcrest"}],"cast":["Robert Redford","Jackie Chan","이제훈"],"backdrop_path":"https://image.tmdb.org/t/p/original/zAarcAlr0coEpea8d95KHfJYgDA.jpg","poster_path":"https://image.tmdb.org/t/p/original/mFyjRMw5lm1EJ2h4n9yGB1F2ZPF.jpg","certification":"N/A","genres":["Documentário","Família","Aventura"],"trailer":"N/A"},
