"759054":{"id":"759054","name":"Rise","slug":"rise","original_title":"Rise","overview":"Depois de emigrar da Nigéria para a Grécia, Vera e Charles Antetokounmpo lutaram para sobreviver e sustentar seus cinco filhos, vivendo sob a ameaça diária de deportação. Desesperados para obter a cidadania grega, eram prejudicados por um sistema que os impedia a cada tentativa, mas a visão, a determinação e a fé da família tiraram seus membros do anonimato para dar início às carreiras de três campeões da NBA.","first_air_date":"2022-06-23","runtime":113,"episode_run_time":[113],"vote_average":7.6,"created_by":["Walt Disney Pictures","Faliro House Productions","NBA Entertainment"],"production_companies":[{"name":"Walt Disney Pictures"},{"name":"Faliro House Productions"},{"name":"NBA Entertainment"}],"cast":["Uche Agada","Dayo Okeniyi","Yetide Badaki","Ral Agada","Jaden Osimuwa"],"backdrop_path":"https://image.tmdb.org/t/p/original/uKL39lSf3rQbcMG8XbByoHBwGId.jpg","poster_path":"https://image.tmdb.org/t/p/original/slkVQhehnP3h40y7mfbYDfv8sWB.jpg","certification":"12","genres":["Drama"],"trailer":"-eQKkeEmeBs"},
