"973468":{"id":"973468","name":"Caminhos da Sobrevivência","slug":"caminhos-da-sobrevivencia","original_title":"WIL","overview":"Wilfried Wils era policial auxiliar em Antuérpia no início da Segunda Guerra Mundial. A cidade está sob o domínio da violência e da desconfiança. Wilfried faz o que pode por si mesmo, evitando caminhos muito escorregadios. Ele recebe atenção e apoio material de um homem que se aliou ao ocupante alemão, Meanbeard, mas também conta com a confiança de seu colega anti-nazista Lode, irmão da amada de Wilfried, Yvette. Wilfried luta para sobreviver enquanto a perseguição aos judeus continua inabalável.","first_air_date":"2023-09-27","runtime":114,"episode_run_time":[114],"vote_average":6.6,"created_by":["Lecter Scripted Media","Menuetto","Minds Meet","Les Films du Fleuve","Topkapi Films","K&K Film Selekt"],"production_companies":[{"name":"Lecter Scripted Media"},{"name":"Menuetto"},{"name":"Minds Meet"},{"name":"Les Films du Fleuve"},{"name":"Topkapi Films"},{"name":"K&K Film Selekt"}],"cast":["Stef Aerts","Matteo Simoni","Annelore Crollet","Jan Bijvoet","Kevin Janssens"],"backdrop_path":"https://image.tmdb.org/t/p/original/hycr8NAoZgCtLxiSNYZL9kCQcCr.jpg","poster_path":"https://image.tmdb.org/t/p/original/FSFhUQD96WlDLfYfheod05WOQo.jpg","certification":"N/A","genres":["Drama","Guerra","História"],"trailer":"N/A"},
