"576071":{"id":"576071","name":"40 Dias - O Milagre da Vida","slug":"40-dias-o-milagre-da-vida","original_title":"Unplanned","overview":"Tudo que Abby Johnson sempre quis foi ajudar outras mulheres. Como uma das diretoras mais jovens da história da Paternidade Planejada, organização responsável por metade dos abortos realizados nos Estados Unidos, ela acreditava ter feito a escolha certa. Até o dia em que algo que Abby viu fez com que tudo mudasse e ela se tornasse uma das principais vozes do movimento pró-vida dos Estados Unidos.","first_air_date":"2019-03-21","runtime":106,"episode_run_time":[106],"vote_average":6.9,"created_by":[],"production_companies":[],"cast":["Ashley Bratcher","Brooks Ryan","Robia LaMorte","Emma Elle Roberts","Robin DeMarco"],"backdrop_path":"https://image.tmdb.org/t/p/original/6JSfLeJqr0KegwcWzxVlS99M5GC.jpg","poster_path":"https://image.tmdb.org/t/p/original/kyoSXlgV8OMGyAfBHwyDECp1m5f.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
