"48415":{"id":"48415","name":"Bem-vindo ao Sul","slug":"bem-vindo-ao-sul","original_title":"Benvenuti al sud","overview":"Alberto é responsável pela agência dos correios em uma cidade pequena em Brianza e para agradar sua mulher Silvia, que gostaria de se mudar para Milão, está pronto para tudo, até mesmo fingir ser deficiente para entrar na lista e obter um emprego na grande metrópole. Sua farça é descoberta, no entanto, a punição de Alberto é ser transferido para uma pequena cidade na Campânia.E é lá na terra da Camorra, que é como ele conhece o lugar, onde \"pagará seus pecados\" até conhecer pessoas legais que tentam fazê-lo se sentir e viver à vontade. Mas como dizer aos antigos amigos e especialmente a Silvia que tudo está bem?","first_air_date":"2010-10-01","runtime":102,"episode_run_time":[102],"vote_average":6.7,"created_by":["Medusa Film","Cattleya","Constantin Film"],"production_companies":[{"name":"Medusa Film"},{"name":"Cattleya"},{"name":"Constantin Film"}],"cast":["Claudio Bisio","Alessandro Siani","Angela Finocchiaro","Valentina Lodovini","Nando Paone"],"backdrop_path":"https://image.tmdb.org/t/p/original/9p9nHDBAabosvWzKmKJZOURo2z5.jpg","poster_path":"https://image.tmdb.org/t/p/original/diKOb5QAFTjCzllB0ZcghmKE2nk.jpg","certification":"N/A","genres":["Comédia"],"trailer":"N/A"},
"19833":{"id":"19833","name":"Conversa Truncada","slug":"conversa-truncada","original_title":"In the Loop","overview":"O Presidente dos Estados Unidos e o Primeiro Ministro do Reino Unido querem começar uma guerra, porém nem todos acreditam que esta seja a melhor alternativa. O general americano Miller e o Secretário de Estado para Assuntos internacionais Britânico Simon Foster são contra a guerra. Quando Foster deixa escapar em uma entrevista que o governo está apoiando a guerra, a mídia transforma o fato em um conflito internacional, e o atrapalhado secretário é enviado aos EUA para resolver a situação.","first_air_date":"2009-01-22","runtime":105,"episode_run_time":[105],"vote_average":7.0,"created_by":["Aramid Entertainment","BBC Film","UK Film Council","Protagonist Pictures"],"production_companies":[{"name":"Aramid Entertainment"},{"name":"BBC Film"},{"name":"UK Film Council"},{"name":"Protagonist Pictures"}],"cast":["Peter Capaldi","Tom Hollander","Gina McKee","James Gandolfini","Chris Addison"],"backdrop_path":"https://image.tmdb.org/t/p/original/baRFkHjBNSEF2frf0Gh8dZBFewl.jpg","poster_path":"https://image.tmdb.org/t/p/original/jL6txnziFSeEifQkqnPBtaPaiXU.jpg","certification":"N/A","genres":["Comédia"],"trailer":"N/A"},
