"17443":{"id":"17443","name":"Justiça Para Todos","slug":"justica-para-todos","original_title":"...And Justice for All","overview":"Arthur Kirkland (Al Pacino) é um advogado idealista que já teve vários desentendimentos (inclusive já foi preso por desacato) com Fleming (John Forsythe), um inflexível juiz. Arthur recebe com surpresa a notícia de que o magistrado foi preso, acusado de estupro, e ironicamente Fleming quer ser defendido por ele, pois como todos sabem da rivalidade que existe entre os dois Kirkland só o defenderia se tivesse certeza da sua inocência. Em retribuição, Fleming promete rever um caso no qual Arthur tenta pôr em liberdade um cliente inocente (Thomas G. Waites), que está preso há dezoito meses.","first_air_date":"1979-10-19","runtime":119,"episode_run_time":[119],"vote_average":7.1,"created_by":["Columbia Pictures"],"production_companies":[{"name":"Columbia Pictures"}],"cast":["Al Pacino","Jack Warden","John Forsythe","Lee Strasberg","Jeffrey Tambor"],"backdrop_path":"https://image.tmdb.org/t/p/original/kPlCjRGUv5okUM8Zsa3xE0sSJHI.jpg","poster_path":"https://image.tmdb.org/t/p/original/l82JLXaJK9hqv08P4A9pTM8OCtq.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
"17317":{"id":"17317","name":"Justiça Urbana","slug":"justica-urbana","original_title":"Urban Justice","overview":"Quando um policial exemplar é morto à queima roupa, o departamento de polícia registra a ocorrência como um ato de violência qualquer. Um grande erro. Aquele jovem policial é filho de um ex-soldado das forças especiais com uma sede insaciável de justiça. Para encontrar o assassino de seu filho, Simon Ballister (Steven Seagal) se muda para a pior vizinhança da cidade. Logo que chega é recebido por dois membros de uma gangue, a qual é mandada de volta sangrando por ele. Ballister não é de desistir facilmente e não vai parar até encontrar o assassino de seu filho. As gangues possuem muitos homens, muita munição, proteção da polícia e a coragem exagerada da juventude. Exatamente tudo o que Ballister pretende usar contra eles.","first_air_date":"2007-10-21","runtime":96,"episode_run_time":[96],"vote_average":5.0,"created_by":["Hood to Hood Productions","Sony Pictures Home Entertainment","XIT Financial Group"],"production_companies":[{"name":"Hood to Hood Productions"},{"name":"Sony Pictures Home Entertainment"},{"name":"XIT Financial Group"}],"cast":["Steven Seagal","Eddie Griffin","Kirk B.R. Woller","Carmen Serano","Liezl Carstens"],"backdrop_path":"https://image.tmdb.org/t/p/original/wNnrNmZe3GBmZnCIroFXPWOMhL4.jpg","poster_path":"https://image.tmdb.org/t/p/original/svQdEbQDt7XqfOmUTHM8YYsvo5Q.jpg","certification":"N/A","genres":["Crime","Ação","Thriller"],"trailer":"N/A"},
"154":{"id":"154","name":"Jornada nas Estrelas II: A Ira de Khan","slug":"jornada-nas-estrelas-ii-a-ira-de-khan","original_title":"Star Trek II: The Wrath of Khan","overview":"Sentido que o futuro em nada se parece com o passado que vivemos, o Almirante James T. Kirk começa a acreditar que cavalgar pelo cosmos é um jogo para os jovens. Até que numa viagem de rotina para inspecionar a U.S.S. Enterprise, a carreira de Kirk na Frota Estelar entra em um novo capítulo quando surge um antigo inimigo, Khan Noonien Singh, um conquistador do século 20 geneticamente alterado. Escapando de sua prisão, Khan planeja capturar o Projeto Genesis, um artefato que pode criar e destruir um planeta num piscar de olhos, e destruir seu velho \"amigo\", Kirk.","first_air_date":"1982-06-04","runtime":112,"episode_run_time":[112],"vote_average":7.5,"created_by":["Paramount Pictures"],"production_companies":[{"name":"Paramount Pictures"}],"cast":["William Shatner","Leonard Nimoy","Ricardo Montalban","DeForest Kelley","James Doohan"],"backdrop_path":"https://image.tmdb.org/t/p/original/oXs8kp1oX5N0Mte6U8UUAwmLwt6.jpg","poster_path":"https://image.tmdb.org/t/p/original/b9FyLkPyIXqZC1IunApc6e7xJ6l.jpg","certification":"L","genres":["Ação","Aventura","Ficção científica","Thriller"],"trailer":"N/A"},
