"10711":{"id":"10711","name":"Operação França II","slug":"operacao-franca-ii","original_title":"French Connection II","overview":"Jimmy \"Popeye\" Doyle (Gene Hackman), um detetive de Nova York, vai até Marselha, França, na tentativa de capturar Alain Charnier (Fernando Rey), um traficante de drogas que escapou entre seus dedos quando foi fazer um \"negócio\" em Nova York. Para complicar a missão, Doyle não fala francês e o detetive Henri Barthelemy (Bernard Fresson) não fica muito feliz com a presença de Jimmy, dizendo que Marselha não é Nova York. Doyle logo sente isto na pele quando a quadrilha de Charnier o captura, lhe deixando confinado no quarto de um decadente hotel. Lá o detetive, segundo Alain, é drogado várias vezes, com o objetivo de deixá-lo viciado. Desta forma nem seria precisa matá-lo, pois um detetive viciado seria expulso da polícia.","first_air_date":"1975-05-18","runtime":119,"episode_run_time":[119],"vote_average":6.8,"created_by":["20th Century Fox"],"production_companies":[{"name":"20th Century Fox"}],"cast":["Gene Hackman","Fernando Rey","Bernard Fresson","Philippe Léotard","Ed Lauter"],"backdrop_path":"https://image.tmdb.org/t/p/original/ffI5k9rPEkEKRTYm4bS4da3Yh20.jpg","poster_path":"https://image.tmdb.org/t/p/original/vu5WRkO8HMg5SP9n4Ntklce0dye.jpg","certification":"N/A","genres":["Ação","Crime","Drama","Thriller"],"trailer":"N/A"},
"10115":{"id":"10115","name":"Virada Radical","slug":"virada-radical","original_title":"Stick It","overview":"Jeff Bridges e a novata Missy Peregrym lideram um jovem elenco em Virada Radical. Depois de ter problemas com a lei, a rebelde ex-ginasta Haley (Peregrym) encontra um destino pior do que a cadeia - trabalhar em uma academia de ginastas dirigida por um famoso técnico linha-dura. Forçada a voltar para o mundo cheio de regras que tinha abandonado, Haley decide se superar e mudar as coisas lá dentro. Mas enquanto o seu amor pelo esporte renasce, ela aprende muitas lições de como fazer as coisas por conta própria e o real significado do termo \"Ser Amigo\".","first_air_date":"2006-04-21","runtime":105,"episode_run_time":[105],"vote_average":6.8,"created_by":["Kaltenbach Pictures","Spyglass Entertainment","Touchstone Pictures"],"production_companies":[{"name":"Kaltenbach Pictures"},{"name":"Spyglass Entertainment"},{"name":"Touchstone Pictures"}],"cast":["Jeff Bridges","Missy Peregrym","Vanessa Lengies","Jon Gries","Gia Carides"],"backdrop_path":"https://image.tmdb.org/t/p/original/alNlFz8PD58NmYZTX5wuZslgnws.jpg","poster_path":"https://image.tmdb.org/t/p/original/4lmEn3PVUSInbtWa9RgpAqpI1Cd.jpg","certification":"N/A","genres":["Comédia","Drama"],"trailer":"N/A"},
