"2447":{"id":"2447","name":"Jesus - A História do Nascimento","slug":"jesus-a-historia-do-nascimento","original_title":"The Nativity Story","overview":"Em 2004, plateias de todo o mundo lotaram os cinemas para conferir a violência e sofrimento de “A Paixão de Cristo”. Agora é a hora de voltar ainda mais no passado e descobrir como esta extraordinária história começou, em uma superprodução focada na emocionante saga de Maria e José - na qual eles enfrentam provações para o seu amor, para a sua esperança e principalmente para a sua fé. Acompanhe a profecia descoberta pelos Três Reis Magos nas estrelas, testemunhe a caçada do temível Rei Herodes ao Messias anunciado e siga a trajetória da mãe do Filho de Deus saindo de Nazaré rumo a Belém, onde nasce então a criança que mudaria o mundo para sempre. Você está convidado a vivenciar a mais eterna das histórias de uma forma como você nunca viu antes.","first_air_date":"2006-11-30","runtime":101,"episode_run_time":[101],"vote_average":7.0,"created_by":["New Line Cinema","Sound for Film","Temple Hill Entertainment"],"production_companies":[{"name":"New Line Cinema"},{"name":"Sound for Film"},{"name":"Temple Hill Entertainment"}],"cast":["Keisha Castle-Hughes","Oscar Isaac","Hiam Abbass","Shaun Toub","Ciarán Hinds"],"backdrop_path":"https://image.tmdb.org/t/p/original/buPWX4RYKQ7L2vHYRQZ52dMMj37.jpg","poster_path":"https://image.tmdb.org/t/p/original/sqi3r1zvzhvDdxwwh4XnPEzos0m.jpg","certification":"10","genres":["Drama"],"trailer":"N/A"},
