"31658":{"id":"31658","name":"A Hora da Pistola","slug":"a-hora-da-pistola","original_title":"Hour of the Gun","overview":"As armas não sossegam por muito tempo quando os justiceiros Wyatt Earp e Doc Holliday enfrentam foras-da-lei no velho Oeste. James Garner (Maverick) e Jason Robards * (ganhador do Oscar®, Todos os Homens do Presidente) são os lendários pistoleiros desta eletrizante história baseada em fatos, considerada \"o mais próximo que alguém já chegou de contar a verdadeira história do tiroteio de OK Corral\" (segundo o L.A. Herald-Examiner). A poeira nem teve tempo de baixar em OK Corral, e os famosos irmãos Clanton estão em busca de vingança. Um a um, eles matam os irmãos de Wyatt Earp - mas não darão o último tiro desta história. Com a autoridade da sua estrela de xerife e Doc Holliday (Robards) como braço direito, Earp (Garner) prepara o ato de vingança que o Oeste nunca mais vai esquecer.","first_air_date":"1967-11-01","runtime":101,"episode_run_time":[101],"vote_average":6.4,"created_by":["The Mirisch Company","United Artists"],"production_companies":[{"name":"The Mirisch Company"},{"name":"United Artists"}],"cast":["James Garner","Jason Robards","Robert Ryan","Albert Salmi","Charles Aidman"],"backdrop_path":"https://image.tmdb.org/t/p/original/iciucIG50Bu5cKbxpZ3vOeHOI9U.jpg","poster_path":"https://image.tmdb.org/t/p/original/4sFnOXm9wvJIfWzfwIvTN1dZ8KE.jpg","certification":"N/A","genres":["Faroeste"],"trailer":"N/A"},
"582927":{"id":"582927","name":"Ya No Estoy Aqui","slug":"ya-no-estoy-aqui","original_title":"Ya no estoy aquí","overview":"Ulises, líder de um grupo apaixonado pela música cúmbia, é forçado a fugir do país para salvar sua vida após um mal-entendido com uma gangue local. O jovem precisa deixar tudo o que ama para trás e se encaixar em uma nova vida enquanto repensa suas escolhas.","first_air_date":"2019-10-21","runtime":112,"episode_run_time":[112],"vote_average":7.9,"created_by":["PPW Films","Panorama Global"],"production_companies":[{"name":"PPW Films"},{"name":"Panorama Global"}],"cast":["Juan Daniel Garcia Treviño","Jonathan Espinoza","Xueming Angelina Chen","Bianca Coral Puente Valenzuela","Tania Alvarado"],"backdrop_path":"https://image.tmdb.org/t/p/original/wFSXN4CaDfmUURbEbghhK6m7WPI.jpg","poster_path":"https://image.tmdb.org/t/p/original/min2PJ67s9HUD5ZeCSKTfSgniSC.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
