"28696":{"id":"28696","name":"O Selvagem","slug":"o-selvagem","original_title":"The Wild One","overview":"Johnny Strabler (Marlon Brando) é o líder de uma gangue de motociclistas conhecida como Black Rebels Motorcycle Club. Eles vivem perigosamente, enfrentando os perigos e arriscando suas vidas inconsequentemente. O grupo chega à Wrightsville, uma pequena cidade, e após causar arruaças tomando o troféu de um vencedor de corridas, seguem para outra cidade, invadindo uma cafeteria. Johnny conhece Kathie Bleeker (Mary Murphy), filha do chefe da polícia, e que trabalha na cafeteria. Ele decide ir embora, mas seu grupo começa mais uma briga, desta vez com um grupo de rivais liderados por Chino (Lee Marvin). (e 14 - Estimado 14 Anos)","first_air_date":"1953-12-30","runtime":79,"episode_run_time":[79],"vote_average":6.6,"created_by":["Stanley Kramer Productions"],"production_companies":[{"name":"Stanley Kramer Productions"}],"cast":["Marlon Brando","Mary Murphy","Robert Keith","Lee Marvin","Jay C. Flippen"],"backdrop_path":"https://image.tmdb.org/t/p/original/atbJUEuf6Y8vcduHLfvaJqPyF6d.jpg","poster_path":"https://image.tmdb.org/t/p/original/q1hrO9xV15hlby4TAr0zvfbRdaT.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
