"413765":{"id":"413765","name":"David Lynch: A Vida de um Artista","slug":"david-lynch-a-vida-de-um-artista","original_title":"David Lynch: The Art Life","overview":"David Lynch nos leva em uma viagem através de seus anos de formação. Desde a educação idílica em uma pequena cidade dos EUA até as ruas escuras da Filadélfia, seguimos Lynch enquanto ele traça os eventos que ajudaram a moldar sua carreira, ao mesmo tempo em que tentamos compreender melhor o diretor.","first_air_date":"2017-02-15","runtime":88,"episode_run_time":[88],"vote_average":6.9,"created_by":["Kong Gulerod Film","Duck Diver Films","Hideout Films"],"production_companies":[{"name":"Kong Gulerod Film"},{"name":"Duck Diver Films"},{"name":"Hideout Films"}],"cast":["David Lynch","Lula Lynch","Edwina Lynch","Donald Lynch","Peggy Reavey"],"backdrop_path":"https://image.tmdb.org/t/p/original/9qMP1aquRST8XfJ58EqTMAZ9kA6.jpg","poster_path":"https://image.tmdb.org/t/p/original/ta4TyMEPbDgxWF0CMxzug8INSBX.jpg","certification":"12","genres":["Documentário"],"trailer":"N/A"},
"39486":{"id":"39486","name":"Secretariat: Uma História Impossível","slug":"secretariat-uma-historia-impossivel","original_title":"Secretariat","overview":"A dona de casa e mãe Penny Chenery não entendia nada de corrida de cavalos, uma área dominada até então por homens. Mas ela assumiu o controle do estábulo de seu pai doente e, com a ajuda de um treinador veterano, contra todas as probabilidades negativas, consegue vencer o prêmio Tríplice Coroa, em 1973. Baseado em fatos reais.","first_air_date":"2010-08-20","runtime":123,"episode_run_time":[123],"vote_average":7.4,"created_by":["Walt Disney Pictures","Fast Track Productions","Mayhem Pictures"],"production_companies":[{"name":"Walt Disney Pictures"},{"name":"Fast Track Productions"},{"name":"Mayhem Pictures"}],"cast":["Diane Lane","John Malkovich","Scott Glenn","Dylan Walsh","Fred Thompson"],"backdrop_path":"https://image.tmdb.org/t/p/original/y2QZ8qCE4YWHo5hGYos26Jy5Req.jpg","poster_path":"https://image.tmdb.org/t/p/original/1Jg9V13Kyw2Z7YEvLOgP16iCtsY.jpg","certification":"L","genres":["Drama"],"trailer":"N/A"},
"74523":{"id":"74523","name":"Nascido Para Correr","slug":"nascido-para-correr","original_title":"Born to Race","overview":"Um jovem corredor rebelde em rota de colisão com seus próprios problemas, após se envolver em um acidente em uma corrida ilegal, é enviado para uma pequena cidade do interior para viver com o pai, uma pessoa até então pouco influente em sua vida. O que parece o fim para este jovem corredor pode se transformar em uma aventura regada a muita gasolina como ele jamais imaginou.","first_air_date":"2011-03-19","runtime":99,"episode_run_time":[99],"vote_average":6.9,"created_by":["American Cinema International","ESX Productions"],"production_companies":[{"name":"American Cinema International"},{"name":"ESX Productions"}],"cast":["Joseph Cross","John Pyper-Ferguson","Brando Eaton","Nicole Badaan","Sherry Stringfield"],"backdrop_path":"https://image.tmdb.org/t/p/original/4gBMg13uOlLDMHn2BhDKekUogAS.jpg","poster_path":"https://image.tmdb.org/t/p/original/wvSV8JWah0ZJpCJAYrQLnLCPfta.jpg","certification":"N/A","genres":["Ação"],"trailer":"N/A"},
"13098":{"id":"13098","name":"Ouro Branco","slug":"ouro-branco","original_title":"Paid in Full","overview":"Rap, carrões, blusões de couro espalhafatosos e muita grana no bolso. O Harlem ferve enquanto os traficantes enriquecem do dia para a noite. O ouro branco modifica as pessoas, transformando o atendente de lavanderia Ace em chefão das drogas. Ace entra para o mundo do crime sem desconfiar que a partir daí sua vida já não vale mais nada. Ele conta agora com a sorte, já que despertou em seus amigos um sentimento nada nobre: a ganância.","first_air_date":"2002-10-25","runtime":98,"episode_run_time":[98],"vote_average":6.8,"created_by":["Loud Films","Roc-a-fella Films","Dimension Films","RAT Entertainment"],"production_companies":[{"name":"Loud Films"},{"name":"Roc-a-fella Films"},{"name":"Dimension Films"},{"name":"RAT Entertainment"}],"cast":["Wood Harris","Cam'ron","Mekhi Phifer","Kevin Carroll","Chi McBride"],"backdrop_path":"https://image.tmdb.org/t/p/original/56AyVhgvQmrOBAF9ZeyOdls4PPa.jpg","poster_path":"https://image.tmdb.org/t/p/original/7twT85kO030XB5lPntvmwD9Ah1O.jpg","certification":"N/A","genres":["Ação","Crime","Drama"],"trailer":"N/A"},
"476764":{"id":"476764","name":"O Favorito","slug":"o-favorito","original_title":"The Front Runner","overview":"Gary Hart, ex-senador do Colorado, torna-se o favorito para a indicação presidencial democrata em 1987. Inteligência, carisma e idealismo de Hart o torna popular entre os eleitores jovens, deixando-o com um caminho aparentemente claro para a Casa Branca. Tudo isso desmorona quando as alegações de um caso extraconjugal aparecem na mídia, forçando o candidato a enfrentar um escândalo que ameaça atrapalhar sua campanha e sua vida pessoal.","first_air_date":"2018-11-06","runtime":113,"episode_run_time":[113],"vote_average":5.9,"created_by":["Bron Studios","Right of Way Films","Creative Wealth Media Finance","Stage 6 Films","Columbia Pictures"],"production_companies":[{"name":"Bron Studios"},{"name":"Right of Way Films"},{"name":"Creative Wealth Media Finance"},{"name":"Stage 6 Films"},{"name":"Columbia Pictures"}],"cast":["Hugh Jackman","Vera Farmiga","J.K. Simmons","Mark O'Brien","Molly Ephraim"],"backdrop_path":"https://image.tmdb.org/t/p/original/kQVo5ECXrTcoMtj8hWbdiqpfPms.jpg","poster_path":"https://image.tmdb.org/t/p/original/3bmV2tuxB9uFRJdhfAh88ucQbml.jpg","certification":"N/A","genres":["Drama","História"],"trailer":"N/A"},
"293452":{"id":"293452","name":"O Quarto dos Esquecidos","slug":"o-quarto-dos-esquecidos","original_title":"The Disappointments Room","overview":"Dana e David formam um casal marcado por um trauma recente. Eles decidem sair da cidade grande e mudar-se para uma área rural junto do filho Lucas. Dana pretende usar seus conhecimentos como arquiteta para reformar a nova casa e superar as dores passadas, até que ela percebe a existência de um quarto escondido, que não constava na planta. Perguntando para moradores locais, descobre que muitas casas da região tinham um cômodo destinado a ocultar segredos de família.","first_air_date":"2016-09-09","runtime":100,"episode_run_time":[100],"vote_average":4.5,"created_by":["Relativity Media"],"production_companies":[{"name":"Relativity Media"}],"cast":["Kate Beckinsale","Mel Raido","Duncan Joiner","Lucas Till","Gerald McRaney"],"backdrop_path":"https://image.tmdb.org/t/p/original/4Xu5gaD3bZwN8w7qQklPo7bfjiI.jpg","poster_path":"https://image.tmdb.org/t/p/original/7i4VpFw8jT4MSaDGbuVYWTwHqk1.jpg","certification":"16","genres":["Terror","Thriller"],"trailer":"N/A"},
