"917007":{"id":"917007","name":"O Nascimento do Mal","slug":"o-nascimento-do-mal","original_title":"Bed Rest","overview":"Depois de anos tentando desesperadamente criar uma família, Julie (Melissa Barrera) está finalmente grávida de novo e se mudando para uma nova casa com seu marido Daniel (Guy Burnet). Ambos estão ansiosos para um novo começo. Quando Julie é colocada em repouso absoluto na cama, ela lentamente começa ser consumida pela monotonia e a ansiedade de suas novas compulsões. Experiências horríveis e assustadoras no apartamento logo começam a cair sobre Julie, despertando demônios de seu passado e fazendo com que outras pessoas questionem sua sanidade. Presa e forçada a enfrentar seu passado e o sobrenatural, Julie luta para proteger a si mesma e a seu bebê ainda não nascido.","first_air_date":"2023-02-10","runtime":90,"episode_run_time":[90],"vote_average":6.3,"created_by":["STXfilms","Project X Entertainment","BondIt Media Capital"],"production_companies":[{"name":"STXfilms"},{"name":"Project X Entertainment"},{"name":"BondIt Media Capital"}],"cast":["Melissa Barrera","Guy Burnet","Edie Inksetter","Sebastian Billingsley-Rodriguez","Erik Athavale"],"backdrop_path":"https://image.tmdb.org/t/p/original/lQzSMhkAl90iXPirjnLbRHkxApC.jpg","poster_path":"https://image.tmdb.org/t/p/original/fKbnk16Af4E34fAK7L7K5GSgpIV.jpg","certification":"12","genres":["Terror"],"trailer":"2kP-PAR_nHI"},
"489243":{"id":"489243","name":"Linha Reta","slug":"linha-reta","original_title":"The Hummingbird Project","overview":"Dois primos metidos a malandros, Anton (Alexander Skarsgård) e Vincent (Jesse Eisenberg), vivem de perigosas transações da bolsa de valores. Seu sonho é construir um cabo de fibra óptica entre o Kansas e Nova Jersey, que os daria vantagem em suas transações, os fazendo milionários. Mas sua jornada para a riqueza não será tão fácil assim, especialmente se depender de sua antiga chefe, Eva (Salma Hayek).","first_air_date":"2019-03-15","runtime":111,"episode_run_time":[111],"vote_average":6.2,"created_by":["Item 7","Belga Productions","HanWay Films","Automatik Entertainment"],"production_companies":[{"name":"Item 7"},{"name":"Belga Productions"},{"name":"HanWay Films"},{"name":"Automatik Entertainment"}],"cast":["Jesse Eisenberg","Alexander Skarsgård","Salma Hayek Pinault","Michael Mando","Johan Heldenbergh"],"backdrop_path":"https://image.tmdb.org/t/p/original/4N6eXAhEm2rdwyMUrY2c4c7lTfO.jpg","poster_path":"https://image.tmdb.org/t/p/original/co43RxflrWS5OqdhdxYPaCPWiWk.jpg","certification":"14","genres":["Thriller","Drama"],"trailer":"LZb-WV6TDg4"},
