"25059":{"id":"25059","name":"A Incrível Jornada II: Perdidos em São Francisco","slug":"a-incrivel-jornada-ii-perdidos-em-sao-francisco","original_title":"Homeward Bound II: Lost in San Francisco","overview":"Este trio adorável está de volta. Desta vez, Chance o Bulldog trapalhão, Sassy a charmosa gatinha e Shadow,o adorável Golden Retriever estão perdidos na agitada cidade de São Francisco. Com novos amigos, cenas engraçadas a cada esquina, os três bichos de estimação precisam atravessar a ponte Golden Gate para encontrar seu lar e sua querida família. Um filme delicioso para agradar a família toda.","first_air_date":"1996-03-08","runtime":89,"episode_run_time":[89],"vote_average":6.6,"created_by":["Walt Disney Pictures"],"production_companies":[{"name":"Walt Disney Pictures"}],"cast":["Michael J. Fox","Sally Field","Ralph Waite","Robert Hays","Kim Greist"],"backdrop_path":"https://image.tmdb.org/t/p/original/47ZwziAUEvfTgeunHFGa2r26Hzx.jpg","poster_path":"https://image.tmdb.org/t/p/original/9bIBuzfkvaMGJRrw9nrrP15UOI5.jpg","certification":"N/A","genres":["Aventura","Comédia","Drama","Família"],"trailer":"N/A"},
