"5708":{"id":"5708","name":"Controle: A História de Ian Curtis","slug":"controle-a-historia-de-ian-curtis","original_title":"Control","overview":"Os últimos anos da vida de Ian Curtis, vocalista da lendária banda inglesa Joy Division. Curtis, que teve uma trajetória curta e intensa, ficou famoso por seu talento de letrista e por suas performances épicas à frente da banda. Sofrendo com os ataques de epilepsia, sem saber como lidar com o seu talento e dividido entre o amor por sua mulher e filha e um caso extraconjugal, ele se enforcou em 18 de maio de 1980, aos 23 anos.","first_air_date":"2007-09-12","runtime":122,"episode_run_time":[122],"vote_average":7.5,"created_by":["Becker International","Claraflora","EM Media","NorthSee","Warner Music UK","Three Dogs And A Pony"],"production_companies":[{"name":"Becker International"},{"name":"Claraflora"},{"name":"EM Media"},{"name":"NorthSee"},{"name":"Warner Music UK"},{"name":"Three Dogs And A Pony"}],"cast":["Samantha Morton","Sam Riley","Alexandra Maria Lara","Joe Anderson","Toby Kebbell"],"backdrop_path":"https://image.tmdb.org/t/p/original/dwxdn3ppDAn7QtaLlhGDEErWfg9.jpg","poster_path":"https://image.tmdb.org/t/p/original/oQbosZPyHzZM9QICz4zfeCNCh6u.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
