"656156":{"id":"656156","name":"Um Homem Implacável","slug":"um-homem-implacavel","original_title":"보호자","overview":"Após 10 anos de encarceramento em nome de seu empregador, tudo o que Su-hyuk deseja é uma vida normal - uma vida que ele espera que inclua sua ex-namorada, Min-seo, e sua filha, In-bi. Mas uma vez que você penetrou nos escalões superiores do submundo, o normal pode ser difícil de encontrar. Enquanto isso, em algum momento da última década, o empregador de Su-hyuk adotou um ar de legitimidade. Hoje em dia, a velha gangue rouba e mata em nome do desenvolvimento urbano. E eles querem o relutante Su-hyuk a bordo.","first_air_date":"2023-08-15","runtime":99,"episode_run_time":[99],"vote_average":6.6,"created_by":["Acemaker Movieworks","Studio Take","Epic Pictures Group"],"production_companies":[{"name":"Acemaker Movieworks"},{"name":"Studio Take"},{"name":"Epic Pictures Group"}],"cast":["정우성","김남길","박성웅","김준한","박유나"],"backdrop_path":"https://image.tmdb.org/t/p/original/tB59fpPnQITgnfxPfMf2gxASTeC.jpg","poster_path":"https://image.tmdb.org/t/p/original/woL8DLY4NLJCg8qKiSrOF4QfMkz.jpg","certification":"N/A","genres":["Ação","Thriller","Drama"],"trailer":"N/A"},
