"828373":{"id":"828373","name":"Um Estranho Entre Nós","slug":"um-estranho-entre-nos","original_title":"Entre nous","overview":"Elodie e Laetitia são duas mulheres profundamente apaixonadas, que sonham em ter uma criança, mas enfrentam sérios problemas financeiros e acreditam que um novo colega de quarto é a solução de seus problemas.","first_air_date":"2023-07-12","runtime":90,"episode_run_time":[90],"vote_average":5.8,"created_by":["CB Partners"],"production_companies":[{"name":"CB Partners"}],"cast":["Iris Jodorowsky","Amandine Noworyta","William Mesguich","Jean-François Stévenin"],"backdrop_path":"https://image.tmdb.org/t/p/original/tJlhqb1IHKwJkpEjurNjcMmGsH1.jpg","poster_path":"https://image.tmdb.org/t/p/original/dWj8Wef74QjRouV9OFhtmGCmqDw.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
"34549":{"id":"34549","name":"As Aventuras de Max Keeble","slug":"as-aventuras-de-max-keeble","original_title":"Max Keeble's Big Move","overview":"Max é um garoto de 12 anos que sofre nas mãos de seus colegas de escola. Ao descobrir que vai se mudar para outra cidade, ele percebe que não tem mais nada a perder e passa a arquitetar planos incríveis para acertar as contas com a turma. Após uma semana de brincadeiras e travessuras inacreditáveis, com a ajuda de seus melhores amigos, Max recebe a pior notícia de sua vida - sua família não vai mais se mudar! E agora, para trocar definitivamente a vida de um derrotado pela de um vencedor, ele terá de enfrentar as consequências de seus atos e improvisar rapidamente uma nova estratégia.","first_air_date":"2001-10-05","runtime":86,"episode_run_time":[86],"vote_average":5.8,"created_by":["Walt Disney Pictures","Karz Entertainment"],"production_companies":[{"name":"Walt Disney Pictures"},{"name":"Karz Entertainment"}],"cast":["Alex D. Linz","Larry Miller","Jamie Kennedy","Zena Grey","Josh Peck"],"backdrop_path":"https://image.tmdb.org/t/p/original/6ErSIhSBMx3PUIkk1OykkFEtjNk.jpg","poster_path":"https://image.tmdb.org/t/p/original/j5siby2i6iwaEdO1d5Rs2oICtiE.jpg","certification":"N/A","genres":["Comédia","Família"],"trailer":"N/A"},
