"26141":{"id":"26141","name":"Distração Fatal","slug":"distracao-fatal","original_title":"Fatal Instinct","overview":"Ned Ravine (Armand Assante) é um policial e advogado que é seduzido por Lola Cain (Sean Young), enquanto Lana Ravine (Kate Nelligan), sua mulher, tem um caso com Frank Kelbo (Christopher McDonald), um mecânico. O casal de amantes planeja matar Ned e receber um seguro de US$ 9 milhões.","first_air_date":"1993-10-29","runtime":91,"episode_run_time":[91],"vote_average":5.4,"created_by":["Metro-Goldwyn-Mayer"],"production_companies":[{"name":"Metro-Goldwyn-Mayer"}],"cast":["Armand Assante","Sherilyn Fenn","Kate Nelligan","Sean Young","Christopher McDonald"],"backdrop_path":"https://image.tmdb.org/t/p/original/mTJHunR5Fr62OsPcTrPrw3YWTAS.jpg","poster_path":"https://image.tmdb.org/t/p/original/syewFnehGbbya5BdxoHLzrcm5Ne.jpg","certification":"N/A","genres":["Comédia","Crime"],"trailer":"N/A"},
