"227735":{"id":"227735","name":"Winter, o Golfinho 2","slug":"winter-o-golfinho-2","original_title":"Dolphin Tale 2","overview":"Depois de sobreviver graças a uma prótese na cauda em Winter, o Golfinho (2011), a sequência mostra o personagem lutando para não ser transferido para um novo aquário após a morte de sua mãe. De acordo com as regras locais, nenhum golfinho pode permanecer sozinho no tanque, precisando do contato com outros golfinhos. Enquanto isso, Winter faz um novo amigo, chamado Hope (esperança).","first_air_date":"2014-09-11","runtime":107,"episode_run_time":[107],"vote_average":6.9,"created_by":["Alcon Entertainment","Boxing Cat Films","Color Force","St. Petersburg Clearwater Film Commision"],"production_companies":[{"name":"Alcon Entertainment"},{"name":"Boxing Cat Films"},{"name":"Color Force"},{"name":"St. Petersburg Clearwater Film Commision"}],"cast":["Morgan Freeman","Ashley Judd","Nathan Gamble","Cozi Zuehlsdorff","Harry Connick Jr."],"backdrop_path":"https://image.tmdb.org/t/p/original/jAXPhMpnJTzBa8oSAP0l9sjYgV8.jpg","poster_path":"https://image.tmdb.org/t/p/original/ahSAq7xEHEibRdxbgshhjJscuno.jpg","certification":"N/A","genres":["Família","Drama"],"trailer":"N/A"},
"12625":{"id":"12625","name":"A Revolta dos Sete Homens","slug":"a-revolta-dos-sete-homens","original_title":"Guns of the Magnificent Seven","overview":"Os Sete Homens cavalgam novamente nesta sequência de uma das mais brilhantes sagas de faroeste da história do cinema. George Kennedy (Rebeldia Indomável) e James Whitmore (Um Sonho de Liberdade) assumem as rédeas de uma aventura corajosa e arrebatadora que não desaponta o espectador! Quando o famoso fora-da-lei Chris Adams (Kennedy) Recebe a oferta de uma enorme recompensa para libertar um jovem revolucionário mexicano da prisão, ele precisa começar reunindo um time da pesada de destemidos guerreiros. Juntos, esses ousados pistoleiros embarcam na aventura de suas vidas - e descobrem uma causa que vale mais do que uma fortuna em ouro.","first_air_date":"1969-07-14","runtime":106,"episode_run_time":[106],"vote_average":5.2,"created_by":["The Mirisch Company","United Artists"],"production_companies":[{"name":"The Mirisch Company"},{"name":"United Artists"}],"cast":["George Kennedy","James Whitmore","Monte Markham","Reni Santoni","Bernie Casey"],"backdrop_path":"https://image.tmdb.org/t/p/original/fhdgjlWESBa9B4G3PDhrXSJo1gK.jpg","poster_path":"https://image.tmdb.org/t/p/original/lyIo9NT7eBGQjRmvtjdOzjwfNOY.jpg","certification":"N/A","genres":["Faroeste"],"trailer":"N/A"},
"433356":{"id":"433356","name":"Amor em Tempos de Guerra","slug":"amor-em-tempos-de-guerra","original_title":"The Ottoman Lieutenant","overview":"Em 1914, uma mulher deixa seu país quando conhece um médico norte-americano que lidera uma missão no exótico Império Otomano. Longe de casa, a garota se apaixona por um oficial do exército otomano e sua lealdade é testada.","first_air_date":"2017-03-28","runtime":106,"episode_run_time":[106],"vote_average":6.1,"created_by":["Eastern Sunrise Films"],"production_companies":[{"name":"Eastern Sunrise Films"}],"cast":["Hera Hilmar","Michiel Huisman","Josh Hartnett","Ben Kingsley","Haluk Bilginer"],"backdrop_path":"https://image.tmdb.org/t/p/original/7RJmCyuTPbckzian3DvSbfgWSYE.jpg","poster_path":"https://image.tmdb.org/t/p/original/x5MIYyGx3ukYXK0jNFxnDYwaiz7.jpg","certification":"14","genres":["Romance","Drama","Guerra"],"trailer":"fOQgugy2-5I"},
"10578":{"id":"10578","name":"Drácula 2 - A Ascensão 2003","slug":"dracula-2-a-ascensao-2003","original_title":"Dracula II: Ascension","overview":"Drácula não morreu. Depois de ficar anos desaparecido, o Príncipe das Trevas retorna em mais um filme de terror arrepiante. Um corpo totalmente carbonizado chega ao necrotério. Ao começar a autópsia, a Dra. Elizabeth nota que está de frente para um corpo completamente sem sangue. Inicia-se uma série de experiências que despertam o vampiro enfurecido e sedento. Ele quer secar as veias daquele grupo de homens e mulheres, mas Drácula não sabe que o padre Uffizi está à sua procura. Conhecido caçador de vampiros, ele não descansará enquanto não eliminar mais este sanguessuga. Uma luta desesperada está para começar..","first_air_date":"2003-06-07","runtime":85,"episode_run_time":[85],"vote_average":5.7,"created_by":["Dimension Films","Castel Film"],"production_companies":[{"name":"Dimension Films"},{"name":"Castel Film"}],"cast":["Stephen Billington","Craig Sheffer","Jason Scott Lee","Jason London","Diane Neal"],"backdrop_path":"https://image.tmdb.org/t/p/original/o3qmCr5eKRoWw43z6U00JaeVgxa.jpg","poster_path":"https://image.tmdb.org/t/p/original/ngomDZt13JdOFjdJIisSCyLqwXh.jpg","certification":"N/A","genres":["Terror","Thriller","Fantasia"],"trailer":"N/A"},
